INSERT INTO `comment` (`id`, `incident_id`, `checkin_id`, `user_id`, `comment_author`, `comment_email`, `comment_description`, `comment_ip`, `comment_spam`, `comment_active`, `comment_date`, `comment_date_gmt`) VALUES
(1, 27, NULL, 0, 'zVEzIM', 'M@GMAIL.COM', 'l believe you brother was the one who was running circles on you. What the Zim embassy is asking is the normal procedure, especially issue of photos.\n There are some bribes to pay but not that much of 600 pounds. l know because l did exactly the same you did', '90.215.46.113', 0, 1, '2012-06-01 11:08:15', NULL),
(2, 36, NULL, 0, 'Mutunda Sugar', 'Mutund@yahoo.com', 'If this is to be effective, video evidence should be encouraged and this can be used as the basis for prosecution. Stories like this are difficult to prove. The whistle blower has to put the audio recording for this story.', '81.138.3.171', 0, 1, '2012-06-01 16:35:16', NULL),
(3, 86, NULL, 0, 'zimbo', 'yy@yahoo.com', 'iam also a victim of that corner union and takawira', '108.162.231.155', 0, 1, '2012-06-30 14:21:14', NULL),
(4, 86, NULL, 0, 'chiweshe', 'death1545@gmail.com', 'i am familiar with this guy.i run a tuckshop near rezende street.they clamp your vehicle and wait for you to approach them to ''make an offer''.their crew especially target those of us who operate busineses in that area as we park there on a daily basis.will try make a video to post.', '173.245.53.217', 0, 1, '2012-07-03 16:51:29', NULL),
(5, 73, NULL, 0, 'musekiwa', 'tee4807@yahoo.com', 'Customs officer do not deal with visas, I am sure you are talking about an immigration officer. Your case does not appear to be a bride but outright theft. If you had reported this maybe you could have your case resolved.', '173.245.50.138', 0, 1, '2012-07-19 23:07:34', NULL);
