(2, 3, 94, 0, 'Experts dismiss draft constitution', '<a href="http://www.herald.co.zw/index.php?option=com_content&amp;view=article&amp;id=47923:experts-dismiss-draft-constitution&amp;catid=37:top-stories&amp;Itemid=130">Experts dismiss draft constitution</a>: <p><span>Some believe the final draft deviated from what the people said while others felt it was a milestone that would advance Zimbabwe’s democratic systems.</span></p>', 'http://blog.ipaidabribe.org.zw/post/27826494699', '2012-07-23 09:45:00'),
(3, 3, 95, 0, 'Chinamasa blasts traffic cops', '<a href="http://www.newsday.co.zw/article/2012-07-21-chinamasa-blasts-traffic-cops">Chinamasa blasts traffic cops</a>: <p><span>Justice and Legal Affairs minister Patrick Chinamasa has castigated the police for their habit of smashing car windscreens while enforcing traffic laws, saying this was tantamount to harassment.</span></p>', 'http://blog.ipaidabribe.org.zw/post/27825799224', '2012-07-23 09:18:00'),
(4, 3, 0, 0, 'Shocking levels of ZRP corruption', '<a href="http://www.thezimbabwean.co.uk/comment/letters/59622/shocking-levels-of-zrp-corruption.html?utm_source=thezim&amp;utm_medium=homepage&amp;utm_campaign=listarticle&amp;utm_content=headinglink">Shocking levels of ZRP corruption</a>: <p>This guy pays 13 bribes in one trip</p>', 'http://blog.ipaidabribe.org.zw/post/27831599365', '2012-07-23 12:56:00'),
(5, 3, 96, 0, 'MDC-T initiate anti -corruption programme', '<a href="http://www.thezimbabwean.co.uk/news/zimbabwe/59620/mdc-t-initiate-anti-corruption.html?utm_source=thezim&amp;utm_medium=homepage&amp;utm_campaign=listarticle&amp;utm_content=headinglink">MDC-T initiate anti -corruption programme</a>: <p><span>Last year the MDC-T fired all its Chitungwiza party councilors after party investigations reportedly unearthed massive graft within the council. The party also suspended several councilors around the country on charges of corruption.</span></p>', 'http://blog.ipaidabribe.org.zw/post/27830539915', '2012-07-23 12:22:00'),
(6, 3, 97, 0, 'Your rights as a resident', '<p>• Right to adequate clean water, decent shelter</p>\n<p>• Right to life</p>\n<p>• A resident has the right to the protection of the law</p>\n<p>• You have a right to effective and fair representation</p>\n<p>• Remember, the person who pays for services is the boss. Your Councillor is your servant, who must take your issues seriously.</p>\n<p>• You have the right to information about your Council, including minutes of full council meetings and its services.</p>\n<p><strong>Duties of Elected Councillors:</strong></p>\n<p>• To formulate policies, by-laws and regulations for the City in the</p>\n<p>interest of citizens</p>\n<p>• To convey residents’ issues at council committees, full council and lobby for them to be translated into policy positions.</p>\n<p>• The councillors, through the Mayor, monitor the impleme-ntation of council resolutions and decisions by the City employees, through the Town Clerk.</p>\n<p>• To provide citizens with regular feedback of council programmes and activities.</p>\n<p>• To Represent the interests of residents and ratepayers at all council business.</p>\n<p><strong>How to hold them accountable:</strong></p>\n<p>• Residents should mobilise, unite and find common ground</p>\n<p>• Regularly convene community meetings to discuss the City council and its services.</p>\n<p>• Elected representatives should respond to residents’ concerns without excuses.</p>\n<p>• Make firm resolutions as citizens and follow them up with the City Council, service providers and your elected representatives.</p>\n<p>• Document your community issues and present your views to your Ward Councillor, the Chairperson of a relevant Council Committee, the Mayor, and the Harare Residents Trust.</p>\n<p>• If it is about corruption, state the date, the people involved and circumstances, and submit your report to your HRT Residents’ Committee in your suburb or call us on the given numbers, or report to the Mayor and Town Clerk.</p>\n<p><strong>Your Responsibility as a Citizen:</strong></p>\n<p>• Pursue your rights and gather as much information as possible to help you lobby policy makers and service providers</p>\n<p>• Pay affordable rates and rentals to the Council every month so that council is able to provide us with satisfactory services</p>\n<p>• Expose corruption by elected representatives and service providers in your community through your residents’ leadership.</p>\n<p>• Practice good hygiene, keep your surroundings clean.</p>\n<p>• Take an active role in non-partisan community initiatives.</p>\n<p>• Share information about services in your area.</p>\n<p>• Know basic details about your Ward Councillor- address, phone numbers, and his/ her participation at council</p>\n<p>• Report service delivery issues to your District Officer, Ward Councillor and or Residents’ Committee.</p>\n<p>• Hold the Residents’ Committee accountable</p>\n<p>• As a collective, provide solutions and alternatives to service delivery issues facing the Council</p>', 'http://blog.ipaidabribe.org.zw/post/27836278094', '2012-07-23 15:11:00'),
