(11, 3, 0, 0, 'What you can do if your rights are violated by a police officer', '<ul><li>If possible, get the name of the police officer and his or her force number (on the badge).</li>\n<li>Make your complaint to the Member-in-Charge at the police station, or tell your lawyer, if you have one.</li>\n<li>If you are taken to court to have your statement confirmed, tell the magistrate.</li>\n<li>You can also go to your nearest Legal Advice Centre for assistance.</li>\n</ul><p>If you feel you have a case for suing the police for wrongful arrest, you must notify</p>\n<p>them within 3 months and make your claim within 6 months.</p>', 'http://blog.ipaidabribe.org.zw/post/28192330460', '2012-07-28 11:27:00'),
