(27, 3, 114, 0, 'A very good question Zimbabweans need to ask themselves, especially as they prepare to choose the country''s leaders', '<p><a href="http://kabweza.tumblr.com/post/28899823862/a-very-good-question-zimbabweans-need-to-ask" target="_blank">kabweza</a>:</p>\n<blockquote>\n<blockquote>\n<p>How is it we have leaders who won’t pay their ZESA &amp;/or TelOne bills &amp; yet we entrust them with positions that directly affect our lives?</p>\n— Sir Nigel (@SirNige) <a href="https://twitter.com/SirNige/status/232727003332218881" data-datetime="2012-08-07T06:36:56+00:00" target="_blank">August 7, 2012</a></blockquote>\n<p>For those of you not in Zimbabwe, ZESA is the national power company in Zimbabwe. TelOne is the sole fixed line phone company.</p>\n</blockquote>', 'http://blog.ipaidabribe.org.zw/post/29034469525', '2012-08-09 06:52:00'),
