(32, 3, 119, 0, 'Be a local change agent! Attend the Harare City Council Budget Consultations.', '<a href="http://www.kubatana.net/html/archive/locgov/120831hrt.asp?sector=LOCGOV">Be a local change agent! Attend the Harare City Council Budget Consultations.</a>: <p><span>Do you want to get involved and make an impact at local level? Go on – say Yes! We encourage residents and ratepayers to attend the Harare City Council Budget Consultations.<br/> Check out the schedule <a href="http://www.kubatana.net/html/archive/locgov/120831hrt.asp?sector=LOCGOV" target="_blank">here</a>, and make a point of going along and having Your Say.</span></p>', 'http://blog.ipaidabribe.org.zw/post/30864714823', '2012-09-04 13:41:00'),
