(45, 3, 130, 0, 'Zimbabwe Police manhandle MP over bribe accusations', '<a href="http://www.newsday.co.zw/2012/10/18/police-manhandle-mp-over-bribe-accusations/">Zimbabwe Police manhandle MP over bribe accusations</a>: <p><span>MDC Member of Parliament for Tsholotsho South, Maxwell Dube, was manhandled by police on Tuesday following a misunderstanding over parking in Gweru.</span></p>', 'http://blog.ipaidabribe.org.zw/post/33828296843', '2012-10-18 10:50:00'),
(46, 3, 0, 0, 'ipaidabribe.org.zw is the ushahidi deployment of the week', '<a href="https://wiki.ushahidi.com/display/WIKI/Deployments+of+the+Week">ipaidabribe.org.zw is the ushahidi deployment of the week</a>: <p>ipaidabribe.org.zw is the ushahidi deployment of the week starting October 23 2012</p>', 'http://blog.ipaidabribe.org.zw/post/34355960853', '2012-10-26 14:01:00'),
(47, 3, 132, 0, 'MDC-T completes probe into corruption allegations', '<a href="http://www.newsday.co.zw/2012/10/30/mdc-t-completes-probe-into-corruption-allegations/">MDC-T completes probe into corruption allegations</a>: <p><span>A team set up by the  MDC-T party to investigate allegations of corruption and poor service delivery by its councillors running the Mutare City Council concluded its probe over the weekend. The findings are expected to be released any time soon.</span></p>', 'http://blog.ipaidabribe.org.zw/post/34628009011', '2012-10-30 10:55:00'),
(48, 3, 134, 0, 'TIZ now allows you to submit corruption reports using SMS', '<a href="http://bulawayo24.com/index-id-technology-sc-mobile+phone-byo-22061-article-TIZ+launches+sms+platform+to+expose+corruption.html">TIZ now allows you to submit corruption reports using SMS</a>: <p><span>TIZ Executive Director Mary-Jane Ncube said her organisation had decided to tap on the current technology through using the mobile based SMS platform because the application is on every cell phone and information would reach a wider cross-section of society from rural to urban areas alike.</span></p>', 'http://blog.ipaidabribe.org.zw/post/34828685288', '2012-11-02 16:00:00'),
(49, 3, 135, 0, 'Ministers under corrruption probe', '<a href="http://allafrica.com/stories/201211020161.html">Ministers under corrruption probe</a>: <p><span>SEVERAL Cabinet ministers are under investigation for corruption, the Zimbabwe Anti-Corruption Commission has said. ZACC chairman Mr Denford Chirindo said those found on the wrong side of the law would face the consequences. Speaking after the launch of ZACC website in Harare yesterday, Mr Chirindo said no one was “untouchable”.</span></p>', 'http://blog.ipaidabribe.org.zw/post/34885507049', '2012-11-03 08:00:00'),
(50, 3, 136, 0, 'ZRP Assistant Commissioner Erasmus Makodza arrested over fraud', '<a href="http://www.newsdzezimbabwe.co.uk/2012/11/top-cop-arrested-over-fraud.html">ZRP Assistant Commissioner Erasmus Makodza arrested over fraud</a>: <p><span>ZIMBABWE Republic Police Assistant Commissioner Erasmus Makodza has been arrested for allegedly acting in cahoots with a local couple to operate an unlicensed security company fraudulently registered after its owner had been allegedly kicked out.</span></p>', 'http://blog.ipaidabribe.org.zw/post/34898902550', '2012-11-03 16:00:00'),
(51, 3, 137, 0, 'Ousted Mayor probed over stands', '<a href="http://www.newsdzezimbabwe.co.uk/2012/11/ousted-mutare-mayor-probed-over-stands.html">Ousted Mayor probed over stands</a>: <p>The M<span>inistry of Local Government, Urban and Rural Development is investigating how suspended Mutare mayor, Councillor Brian James and MDC-T Chikanga-Dangamvura Senator, Keresencia Chabuka, got vast low-density stands measuring close to 10 000 square metres for knocked down prices.</span></p>', 'http://blog.ipaidabribe.org.zw/post/35047377750', '2012-11-05 10:22:00'),
(52, 3, 0, 0, 'My Blabbery: Listening to you', '<a href="http://takunda.tumblr.com/post/35199986604/listening-to-you">My Blabbery: Listening to you</a>: <p><a href="http://takunda.tumblr.com/post/35199986604/listening-to-you" target="_blank">takunda</a>:</p>\n\n<blockquote>\n<p>They’ll tell you your opinion is wrong,<br/>They’ll tell you your predictions are off<br/>They’ll tell you you’re looking at it the wrong way</p>\n<p>They’ll tell you you’re doing it the wrong way</p>\n<p>They’ll tell you it can’t be done<br/>They’ll tell you what they would want to hear</p>\n<p>….And when you prove them wrong by…</p></blockquote>', 'http://blog.ipaidabribe.org.zw/post/35561586459', '2012-11-12 15:55:00'),
(53, 3, 139, 0, 'Biti takes aim at border corruption', '<a href="http://www.dailynews.co.zw/article/News/76049349-ac7f-4b54-8a5e-98e40677d991">Biti takes aim at border corruption</a>: <p><span>Finance minister Tendai Biti has blasted rising border corruption and lamented the incredible losses being incurred by the fiscus through leakages.</span><br/><br/><span>Presenting a $3,8 billion 2013 national budget in Parliament last week, Biti said border officials were employing delaying tactics in clearance of goods to force desperate importers to fork out bribes to push for faster clearance.</span><br/><br/><span>The tough-talking Finance minister said efforts by government to curb corruption by Zimbabwe Revenue Authority (Zimra) officials and tax payers has not yielded any fruit so far.</span><br/><br/><span>But, not anymore.</span></p>', 'http://blog.ipaidabribe.org.zw/post/36060794236', '2012-11-19 14:04:00'),
(54, 3, 0, 0, 'Corruption undermines health service', '<a href="http://www.newsday.co.zw/2012/11/29/corruption-undermines-health-service/">Corruption undermines health service</a>', 'http://blog.ipaidabribe.org.zw/post/36801084609', '2012-11-29 11:04:00'),
(55, 3, 0, 0, 'New site for publishing ‘censored’ content is launched', '<a href="http://www.humanipo.com/blog/2676/New-site-for-publishing-censored-content-is-launched">New site for publishing ‘censored’ content is launched</a>: <p><strong>Global journalism campaigning organisation Reporters sans Frontières (Reporters without Borders) last week unveiled a website under the brand name ‘We Fight Censorship,’ intended to publish content that has been banned, censored or which had been a cause for retribution against the author</strong></p>', 'http://blog.ipaidabribe.org.zw/post/37111797399', '2012-12-03 16:18:00'),
(56, 3, 0, 0, 'Pledge your support for a free and open internet', '<a href="https://www.google.com/takeaction/?utm_source=google&amp;utm_medium=hpp&amp;utm_campaign=12032012freeandopen_en">Pledge your support for a free and open internet</a>', 'http://blog.ipaidabribe.org.zw/post/37182302640', '2012-12-04 13:48:00'),
(57, 3, 142, 0, 'Corrupt police make driving in Zimbabwe a costly affair - TrustLaw', '<a href="http://www.trust.org/trustlaw/news/corrupt-police-make-driving-in-zimbabwe-a-costly-affair/#.UL7m3xGzguw.tumblr">Corrupt police make driving in Zimbabwe a costly affair - TrustLaw</a>: <p>Anti-corruption activist Tawanda Kembo said he was inspired to create an online portal for reporting bribes, <a href="http://www.ipaidabribe.org.zw/" target="_blank"><a href="http://www.ipaidabribe.org.zw" target="_blank">www.ipaidabribe.org.zw</a></a>, because there was no effective platform for members of the public to report police corruption.</p>\n<p>“Do I feel the police are doing enough to fight corruption within their ranks? No,” he said.</p>\n<p>“A start would be to have all officers walk with their badge number displayed visibly. This is what I am trying to do with my website, which has now become the most popular way of reporting corruption in Zimbabwe,” he said.</p>', 'http://blog.ipaidabribe.org.zw/post/37246982351', '2012-12-05 08:18:00'),
