(63, 3, 0, 0, 'President Mugabe vows to fight corruption', '<a href="http://www.dailynews.co.zw/article/News/08dff5dd-551f-4414-bddc-9c8ca83557eb">President Mugabe vows to fight corruption</a>: <p>#nextelection</p>', 'http://blog.ipaidabribe.org.zw/post/37469566926', '2012-12-08 14:00:00'),
(64, 3, 0, 0, 'Minister demands $10 Million bribe', '<a href="http://www.myzimbabwe.co.zw/news/1131-mines-and-mining-development-minister-obert-mpofu-demanded-10-million-bribe.html?&amp;tmpl=component">Minister demands $10 Million bribe</a>: <p><span>President Robert Mugabe was reportedly informed Mines and Mining Development minister Obert Mpofu allegedly demanded a $10 million kickback from Core Mining and Mineral Resources director Lovemore Kurotwi, the High Court heard yesterday. Kurotwi’s lawyer Beatrice Mtetwa asked Zimbabwe Mining Development (ZMDC) chairperson Godwills Masimirembwa if he was aware Kurotwi was being prosecuted because he reported Mpofu to the President.</span></p>', 'http://blog.ipaidabribe.org.zw/post/37899428202', '2012-12-14 11:34:00'),
(65, 3, 147, 0, 'Most Corrupt Country Award Goes to Afghanistan', '<a href="http://globalvoicesonline.org/2012/12/14/most-corrupt-country-award-goes-to-afghanistan/">Most Corrupt Country Award Goes to Afghanistan</a>: <p><span>Afghanistan is considered the world’s most corrupt country, ranking roughly on par with North Korea and Somalia in an </span><a href="http://www.transparency.org/cpi2012/results" target="_blank">annual survey</a><span> of 176 nations published on December 5 by </span><a href="http://en.wikipedia.org/wiki/Transparency_International" target="_blank">Transparency International</a><span> (TI)….</span></p>', 'http://blog.ipaidabribe.org.zw/post/38140226332', '2012-12-17 13:16:00'),
(66, 3, 0, 0, 'Over 100 ZRP Officers Blacklisted For Corruption', '<a href="http://www.zimeye.org/?p=70547">Over 100 ZRP Officers Blacklisted For Corruption</a>: <p><span>Based on a report from the Police Chief, in 2012, 103 police officers were arrested for corruption. Of the cited culprits, 32 were tried at criminal courts and 60 under the Police Act as 11 were discharged from service.</span></p>', 'http://blog.ipaidabribe.org.zw/post/40250857470', '2013-01-11 14:45:00'),
(67, 3, 0, 0, '&quot;The fight against corruption needs to start with the bribe giver&quot;', '“The fight against corruption needs to start with the bribe giver”<br/><br/> - <em><span>Bobby Godsel</span></em>', 'http://blog.ipaidabribe.org.zw/post/42014865592', '2013-02-01 12:39:00'),
(68, 3, 0, 0, 'To hell with your bribe - Mzembi', '<a href="http://www.dailynews.co.zw/article/News/afc99ed8-2e92-47f1-950c-0975aaa515c4">To hell with your bribe - Mzembi</a>: <p><span>Tourism and Hospitality minister Walter Mzembi has sensationally claimed listed miner RioZim Limited (RioZim) tried to bribe him with $100 000 in a bid to silence him on disturbances at its Renco Mine (Renco).</span></p>', 'http://blog.ipaidabribe.org.zw/post/42345766471', '2013-02-05 12:00:00'),
(69, 3, 151, 0, 'How to deal with Harare City Council', '<img src="http://25.media.tumblr.com/f234c649631352d75853d3c2e2181112/tumblr_mjlpm56CW11qlobmwo1_400.jpg" /><br/><br/><p><span>How to deal with Harare City Council</span></p>', 'http://blog.ipaidabribe.org.zw/post/45265760291', '2013-03-13 15:32:00'),
(70, 3, 152, 0, 'Anti-graft body turns to Mugabe', '<a href="http://www.newsday.co.zw/2013/03/13/anti-graft-body-turns-to-mugabe/">Anti-graft body turns to Mugabe</a>: <p><span>The Zimbabwe Anti-Corruption Commission (ZACC) yesterday reportedly approached President Robert Mugabe seeking his intervention after armed police allegedly stormed its offices and blocked ZACC officers from raiding Zimbabwe Mining Development Corporation (ZMDC) offices in Harare.</span></p>', 'http://blog.ipaidabribe.org.zw/post/45264658982', '2013-03-13 14:59:00'),
(71, 3, 0, 0, 'Did you know that you can remember the value of Pi (3.1415926)...', '<img src="http://25.media.tumblr.com/b77bb27da6b1bae4f10d67d683dcece0/tumblr_mjoufxg5ET1qlobmwo1_500.jpg" /><br/><br/><p>Did you know that you can remember the value of Pi (3.1415926) by counting each words letters in “May I have a large container of coffee”?</p>', 'http://blog.ipaidabribe.org.zw/post/45404849925', '2013-03-15 08:09:00'),
(72, 3, 154, 0, 'High Court stops anti-graft searches', '<a href="http://www.herald.co.zw/index.php?option=com_content&amp;view=article&amp;id=70681:high-court-stops-anti-graft-searches&amp;catid=37:top-stories&amp;Itemid=130#.UUK4dNaNk6t">High Court stops anti-graft searches</a>: <p>THE High Court has stopped the Zimbabwe Anti-Corruption Commission from conducting searches at the offices of <span>the National Indigenisation and Economic Empowerment Board.</span></p>', 'http://blog.ipaidabribe.org.zw/post/45418228056', '2013-03-15 16:00:00'),
(73, 3, 0, 0, 'Labour dispute opens Pandora’s box at Anti-Corruption Commission', '<a href="http://www.sundaymail.co.zw/index.php?option=com_content&amp;view=article&amp;id=34351:labour-dispute-opens-pandoras-box-at-anti-corruption-commission&amp;catid=38:local-news&amp;Itemid=131#.UUbAiheNk6s">Labour dispute opens Pandora’s box at Anti-Corruption Commission</a>: <p><span>A labour dispute between the Zimbabwe Anti-Corruption Commission (ZACC) and 26 investigators and intelligence officers under its employ has opened a Pandora’s box, bringing under the spotlight the questionable activities of the anti-graft body.</span></p>', 'http://blog.ipaidabribe.org.zw/post/45660207943', '2013-03-18 09:24:00'),
(74, 3, 157, 0, 'Africa loses £3000 a second due to corruption in the oil, mining...', '<img src="http://24.media.tumblr.com/d13eac25c989aa93c30d2e3b0771f528/tumblr_mjx987JlI31qlobmwo1_500.jpg" /><br/><br/><p><span>Africa loses £3000 a second due to corruption in the oil, mining and gas industries, robbing poor communities of the wealth under their feet.</span></p>', 'http://blog.ipaidabribe.org.zw/post/45820032862', '2013-03-20 08:00:00'),
(75, 3, 158, 0, 'Zimbabwe anti-corruption chief remains in jail despite getting bail', '<a href="http://nehandaradio.com/2013/03/26/zimbabwe-anti-corruption-chief-remains-in-jail-despite-getting-bail/">Zimbabwe anti-corruption chief remains in jail despite getting bail</a>', 'http://blog.ipaidabribe.org.zw/post/46503929402', '2013-03-28 15:34:00'),
(76, 3, 159, 0, 'Traffic cops arrested for bribery', '<a href="http://www.newsday.co.zw/2013/04/04/traffic-cops-arrested-for-bribery/">Traffic cops arrested for bribery</a>: <p><span>A POLICE assistant inspector from Matobo Police Station has been arrested alongside five of his subordinates for allegedly demanding bribes from motorists at a roadblock they manned in the district.</span></p>', 'http://blog.ipaidabribe.org.zw/post/47095149350', '2013-04-04 10:11:00'),
(77, 3, 160, 0, 'Trial date for Zimbabwe Anti-Corruption Commission boss set', '<a href="http://www.thezimbabwean.co.uk/news/zimbabwe/64852/trial-date-for-zimbabwe-anti.html">Trial date for Zimbabwe Anti-Corruption Commission boss set</a>: <p>umbo, who is out on $1 000 bail, appeared at the Harare Magistrates Court before Magistrate Don Ndirowei today where the trial date was set.</p>\n<p>Allegations against Gumbo are that in 2010, he bought offices to be used by the ZACC in Mt Pleasant using government funds but registered the property in the name of a company he jointly owned with four of his subordinates- Sukai Tongogara, Edwin Mubataripi, Christopher Chisango and Gibson Mangwiro.</p>', 'http://blog.ipaidabribe.org.zw/post/47618263639', '2013-04-10 15:27:00'),
