(79, 3, 0, 0, '&quot;Powerlessness and silence go together. We should use our positions not as a shelter from the...&quot;', '“Powerlessness and silence go together. We should use our positions not as a shelter from the world’s reality, but as a platform from which to speak. A voice is a gift. It should be cherished and used.”<br/><br/> - <em>Margaret Atwood</em>', 'http://blog.ipaidabribe.org.zw/post/47777868757', '2013-04-12 15:00:00'),
