(82, 3, 0, 0, 'Event Postponed - Important information RE: RHoK ''Hacking Against Corruption'' Hackathon', '<p><p><span>Due to the unprecedented popularity of the original event scheduled for April 27<sup>th</sup> &amp; 28<sup>th</sup> 2013, we have decided to postpone it </span><span>to June 22nd &amp; 23rd </span><span>because our resources are not enough to accommodate everyone who has expressed interest in participating in this event. Th next couple of month will give us enough time to acquire enough resources to accommodate everyone who wants to take part, bring a bigger event and thus make a more significant impact.</span></p>\n<p><span>We apologise for any inconveniences we may have caused. It was a difficult decision!</span></p></p>', 'http://blog.ipaidabribe.org.zw/post/48922528500', '2013-04-26 13:12:00'),
(83, 3, 165, 0, 'Saviour Kasukuwere accuses RBZ governor Gideon Gono of being the country’s most corrupt person.', '<a href="http://www.radiodialogue.com/gono-corrupt-kasukuwere/">Saviour Kasukuwere accuses RBZ governor Gideon Gono of being the country’s most corrupt person.</a>: <blockquote>Indigenisation and Empowerment minister, Saviour Kasukuwere on Wednesday accused Reserve Bank of Zimbabwe governor Gideon Gono of being the country’s most corrupt person.</blockquote>\n<p><span>Indigenisation and Empowerment minister, Saviour Kasukuwere on Wednesday accused Reserve Bank of Zimbabwe (RBZ) governor Gideon Gono of being the country’s most corrupt person.</span></p>', 'http://blog.ipaidabribe.org.zw/post/49171450552', '2013-04-29 13:05:00'),
