INSERT INTO `incident` (`id`, `location_id`, `form_id`, `locale`, `user_id`, `incident_title`, `incident_description`, `incident_date`, `incident_mode`, `incident_active`, `incident_verified`, `incident_dateadd`, `incident_dateadd_gmt`, `incident_datemodify`, `incident_alert_status`, `incident_zoom`) VALUES
(2, 2, 1, 'en_US', 1, 'Road block', 'When I was travelling from Harare to Norton yesterday afternoon and was stopped at a road block and upon learning that I did not have a fire extinguisher, the police officer asked me to pay a $20 fine. I told him that I did not have that kind of money and that I could I only had $2 on me. I offered to give him the $2 note as a bribe but he said it''s two little and that I should at least give him $3. I gave him the $3 and he accepted it, put it in his pocket and told me to diappear', '2012-05-18 13:50:00', 1, 1, 1, '2012-05-18 16:00:49', NULL, '2012-06-01 12:43:02', 2, 7),
(3, 3, 1, 'en_US', 1, 'ZESA', 'I paid $10 to the ZESA guy so that my electricity is not cut off for an overdue bill', '2012-05-21 12:43:00', 1, 1, 0, '2012-05-21 12:46:18', NULL, '2012-06-01 12:34:38', 2, 7),
(4, 4, 1, 'en_US', 1, 'didn''t have to pay a bribe', 'This video shows someone who didn''t have to pay a bribe', '2012-05-21 13:15:00', 1, 1, 1, '2012-05-21 16:16:46', NULL, '2012-11-14 10:04:08', 2, 1),
(9, 9, 1, 'en_US', 1, 'traffic bribe', 'I pay a bribe almost on a daily basis along Seke road where Police have a regular roadblock just before the fly-over. If I choose not to pay I am delayed and it becomes frustrating and to avoid being delayed I just pay the bribe to police officers.', '2012-05-23 13:21:00', 1, 1, 1, '2012-05-23 14:26:58', NULL, '2012-06-01 12:26:44', 2, 7),
(32, 32, 0, 'en_US', NULL, 'Tawanda', 'My brother what do think , personally I don''t think there is a problem in bribing someone kuti zvinhu zvako zvifambe fast coz these guys havatambire mari imagine the hassle that u go through only to pay a fine of $5, me I paid a bribe ndabatwa ne public drinking and the guys took me to the station ndaramba kubhadhara, tasvika kwanga kusina ma receipts I was told tokuvharira until Monday ma receipts auya kubva ku Harare and it was Saturday morning what was I supposed to do I had to pay my way out. Its like the system is rotten so everyone will just follow suit kuti uwane zvaunoda. Pamberi nekubhara kuti uwane freedom usadzimirwa magetsi ,u7sapinda muchitokisi, uwane pambi fast , duty remota riite shoma. Zviri nani tipe mapurisa nema officers mari than kupa chihurumende chambavha', '2012-06-01 01:19:00', 1, 1, 0, '2012-06-01 09:31:14', NULL, NULL, 2, 1),
(11, 11, 0, 'en_US', NULL, 'I always pay a bribe to get past the police', 'I haven''t paid my car registration in a while so I always pay a bribe to get past the police.', '2012-05-24 13:58:00', 1, 1, 0, '2012-05-24 14:07:39', NULL, NULL, 2, 7),
(27, 27, 1, 'en_US', 1, 'passport', 'i live and work in the UK and i lost my passport, i was asked to pay 65 pouds of which i don''t understand what is it for. further to that they have their own disgnated shop there near the embassy where u have to take passport photos. if you bring your own photos'' they won''t accept them. I was told that i''ve got two choices;\n1)leave the form at the embassy and we will send it to Harare but it can take up 6 months or more(basically this means you wont get through the embassy)\n2)Send it to your relatives to submit it for you.\nI opted for choice number 2 and sent the form to my brother back home. All the applications from outside Zimbabwe have to be submitted in Harare, so my brother went there to submit only to be arrested for silly reasons and i had to pay for his release and my passport to be procesed. i payed 600 pounds for the bribes including my passport plus the 65 pounds bribe in London.', '2012-05-31 23:17:00', 1, 1, 0, '2012-05-31 23:45:08', NULL, '2012-06-01 06:31:48', 2, 7),
(28, 28, 1, 'en_US', 1, 'Driving licence', 'My sister failed her provisional test because she did not pay a bribe ,she wrote it a few days later and it was a different marker/or different people marking she passed .\nShe now has paid $200 to guarantee passing her driving test as long as she does not hit the drums .', '2012-06-01 01:27:00', 1, 1, 0, '2012-06-01 08:31:28', NULL, '2012-06-01 12:23:46', 2, 7),
(29, 29, 1, 'en_US', 1, 'ZESA Guy', 'There is a ZESA guy well known in Chitungwiza Unit H. Usually he wait for those responsible guys to switch off defaulters. And he wil come and ask for 30-50 US to reconnect. I think he z working with the management in doing his underhand dealings.', '2012-06-01 01:44:00', 1, 1, 0, '2012-06-01 08:48:20', NULL, '2012-06-01 12:18:39', 2, 7),
(30, 30, 1, 'en_US', 1, 'Hazard Lights', 'Was stopped after going through a dysfunctional traffic light and fined $10 for not putting on my hazard lights whilst crossing the intersection. I am sure there is no law in the Zim Road Traffic act that says you have to put on your hazard lights if the traffic lights aren''t working... This is just the police attempting to extort money from us. I claimed not to have money on me and so the police eventually just let me go.', '2012-06-01 01:59:00', 1, 1, 0, '2012-06-01 09:05:23', NULL, '2012-06-01 12:00:35', 2, 7),
(31, 31, 1, 'en_US', 1, 'I Paid Bribe at VID', 'It was after three failed attempts of trying to get a driver''s licence when I was finally introduced to a VID Examiner. On the first attempt I was convinced into paying the bribe fee of $100 through my driving school instructor, who turned to be conman after failing to hand it over to those in charge( the VID examiners). The other two attempts I chose not to pay anything only to realise that I was never going to get it. That is when I was introduced to the VID Examiner who demanded $100. I paid the $100, and it was so certain that I was going to pass the test. It was the easiest and fastest ever.', '2012-06-01 01:11:00', 1, 1, 0, '2012-06-01 09:18:39', NULL, '2012-06-01 12:24:58', 2, 7),
(33, 33, 1, 'en_US', 1, 'ZESA -$50 bribe(Msasa park-Hre)', 'My electricity was cut for overdue bill. Immediately, went back to pay at Zesa offices, but the lazy brats never came on time to open. I had to spend three days without getting re-connected, I then decided to connect myself(switch on the mains-simply process). The Zesa guy came four weeks down the line and demanded an explanation as to why we now had electricity..we showed him the payment receipt. He could not hear of it, his paper was showing otherwise.....the guy threatened my wife with $1500 fine for illegal connection..Had to tell my wife to give him $10, He demanded $50. We paid him......\n\nThree weeks later, I was cut again. This time I went to ZESA and dikapenga ikoko...my electricity was restored without bribe, as i now have an agreed payment plan', '2012-06-01 01:29:00', 1, 1, 0, '2012-06-01 09:42:20', NULL, '2012-06-01 12:20:26', 2, 7),
(34, 34, 1, 'en_US', 1, 'police', 'was passing nyazura driving my SA registered car, no driver''s licence but has certified photocopy and police report from durban central police station.\n\nthe insisted i pay a fine for driving without a valid licence. i paid US$5 to the youthful police officer.', '2012-06-01 10:34:00', 1, 1, 0, '2012-06-01 10:38:37', NULL, '2012-06-01 12:14:17', 2, 7),
(35, 35, 1, 'en_US', 1, 'Customs Officer at Breitbridge refuse to stamp SA invoices for VAT reimbursement unless....', 'Upon return from SA through Breitbridge, I neeeded to get my SA invoices stamped by Zim customs authorities in order to mail in my request to SA for the reimbursement of my VAT.  The custom officer, and later his big boss, refused to do so indicating that I would have to fill out a series of forms and that it would probably take 3-4 hours to do so unless... \n\nI refused to wait that long, I was allowed into Zimbabwe with the merchandise, but I didn''t get the needed import stamp on the invoices - which had already been stamped by SA authorities upon leaving SA.', '2012-05-05 09:30:00', 1, 1, 0, '2012-06-01 10:43:17', NULL, '2012-06-01 12:40:24', 2, 7),
(36, 36, 1, 'en_US', 1, 'CID Zvishavane', 'I paid a bribe to the CID zvishavane officials in 2010.the respective detectives are are Sgt MOYO cell number 0772770522 and SGT Natingwe cell number 0772732545.these officers they locked me for three days at zvishavane police cells for gold trading of which they didnt find any gold with me or anything that may lead me to gold trading.these officers were paid by a gold dealer named TAU in zvishavane to arrest and lock me as we had earlier beef between me and him.I paid a bribe of 1000us to these officers and 500us to the magistrate at the court at the time.These detectives were well known at the time of corrupt activities.They even told me that if you dont pay i was going to rot in police cells.It was a horrible experience fellow countryman.I have recorded conversation with these deetectives in which they initially demanded 2000us dollars.', '2012-06-01 11:12:00', 1, 1, 0, '2012-06-01 11:25:25', NULL, '2012-06-01 12:08:19', 2, 7),
(37, 37, 1, 'en_US', 1, 'Sale of Mobile Sim Cards at Econet Shops', 'Many Econet Wireless outlets in Harare hardly have Sim cards in stock but are abundant in the streets. With the requirement that one has to register the line (Simcard) when purchasing one wonders vendors manage to get those lines. I experienced a situation where visitors in Zimbabwe had to buy the lines from vendors and these lines were registered in some unknown individuals.  Econet wireless''s reputation (and of Zimbabwe as well) is compromised by a few greedy workers who put the simcards in streets instead of selling in the official outlets.', '2012-06-01 11:57:00', 1, 1, 0, '2012-06-01 12:13:53', NULL, '2012-06-01 12:45:26', 2, 7),
(38, 38, 1, 'en_US', 1, 'DRIVING LICENCE', 'in 2009 visited zimbabwe. i did not want to use my british driving licence, so i had to pay a bribe to get a zimbabwean driving licence.this was arranged through the CIDs offices near the Harare Central Police station', '2012-06-01 12:20:00', 1, 1, 1, '2012-06-01 12:34:10', NULL, '2012-06-01 12:44:33', 2, 7),
(39, 39, 1, 'en_US', 1, 'bribe to avoid cut off on power', 'I was a tenant in Glen View and when I started staying there, there was a ZESA bill of $300 which I did not contribute to. When the person from ZESA came to cut off the power supply he proposed that I give him $20 so that he does not close. We negotiated down to $15. The land lord did not pay the bill and a few months down the line the ZESA person came again and again wanted $20 but this time we refused and they just cut off. This is something that happens in the whole community, in a day one man can get between $10 and $20 from more than 20 houses and there are some very unfortunate innocent people who are suffering.', '2012-06-01 13:25:00', 1, 1, 0, '2012-06-01 15:05:25', NULL, '2012-06-01 15:51:39', 2, 7),
(40, 40, 1, 'en_US', 1, 'police corruption', 'i was stopped at a police road block and one impudent officer approached my car and asked for my licence. i showed him and he insisted in wanting to see it properly. i gave him and he retained it in his hand. now that he was in control, he asked for a fire extinguisher, red reflectors and spare wheel which i showed him.  Not satisfied, he went in front of the car and checked on the vehicle licence which was in order. He then asked for the radio radio which i didn''t have on me.Then started my ordeal. He barked, "you enjoy music in your car but you want to pay for a radio licence" Afteral, your car is also not in a clean and sanitary condition, both are offences. Your fine is 40 dollars, and pay it to that lady with the receipt book" I said i did not have that money on me. He became very angry, and shouted at me that i had to phone someone to bring the money. Otherwise i will look for more offences. Then after about 5 minutes, one of the officers approached me and said" problem ndeyei babamudiki?". I told him the problem and he said, aa, unotadza kutaura nemapusrisa here kuti uende.I said what i was supposed to do, and he said une marii ipapo, and i said i had only 2 dollars on me. He beckoned the officer who had my licence and said ''ati ane yedrink!". "Marii?, he boomed threateningly, i said 2 dolars and he threw a tantrum threatening to fix me if i wanted to be clever. I was shocked what wrong i had done to invite that anger. The other more gentle officer, said "wedzera mbijana kani officer vakisiye". I added another dollar, and he threw my licence in my face and walked away.I only left the scene after about 20 minutes and had to be late for work', '2012-06-01 13:08:00', 1, 1, 0, '2012-06-01 15:28:00', NULL, '2012-06-01 15:54:23', 2, 7),
(41, 41, 1, 'en_US', 1, 'Police Bribe', 'I have a foreign registered vehicle as I stay outside Zim. Had arrived in Byo the night before and wanted to take my family to Vic Falls. My Uncle offered to drive since I had just arrived from a long journey the previous day, and I was sitting on the passenger seat besides him. We got to a Police Road block just outside Byo, and the Police Officer said we had broken the laws of Zim by not having an affidavit authorising my uncle to drive. I explained that the way I understood it, one is only required to do that if the onwer of the vehicle is not travelling with the driver because logically, I cannot claim that my car is stolen if I am in the same car. I have driven in Zim before, am Zimbabwean and never had problems before as long as I travelled with my IDs  that match with details on the documents of the car to prove that I own the car.The police officer insisted that we had broken the law, and had to pay a fine of US$400 at the Zimra offices back in Byo, and thus our car was impounded. They told us we had to wait until more cars had been impounded for them to provide a police escort back to Byo. My children had been excited to go and see Vic Falls, and out journey had been disturbed by a ruthless police officer. I challenged her and they completetely ignored us after asking us to pull off very far away from the road. My Uncle later on went to the female police officer and paid her US$20. I was very angry for this incident so much that later on after returning  from Vic falls, we went to a Police station to clarify, and the Officer there confirmed that an affidavit to authorise driver is only required if the onwer of the car is not there. I wish I had photographed the police officer in order to report. Its one thing to pay when you have broken the law, but its very unaaceptable when you know very well that you have not broken the law, but you pay just to avoid the inconvenience of the delays.', '2012-06-01 13:10:00', 1, 1, 1, '2012-06-01 16:29:23', NULL, '2012-06-02 06:22:51', 2, 7),
(42, 42, 1, 'en_US', 1, 'Corruption at Beitbridge', 'I''m one of those Zimbos who had never paid bribes for anything...until my brief visit to South Africa last year(August). On my way back, the bus I was on stopped on the Zimbabwean side at about 9AM and we were told the ZIMRA guys would open and search every bag. But they didn''t actually start doing that but merely stated that the whole process would take a very long time, maybe 6 hours! The driver and conductor had already asked every passenger to "contribute" R20 even before we arrived at the border. It was disgusting to see OPEN, NAKED, RAW corruption at 9AM that sunny morning. I asked a fellow passenger and she told me this is standard practice. Sadly, I actually know the senior ZIMRA guy from his days in Harare. He greeted me cheerfully and was smiling all the time, asking what I had brought for his team from South Africa!', '2012-06-01 13:58:00', 1, 1, 0, '2012-06-01 18:08:45', NULL, '2012-06-02 06:07:25', 2, 7),
(49, 49, 1, 'en_US', 1, 'ZRP/ZNA worse than Magumagumas', 'ZNA/ZRP officers stationed along the Limpopo River are making a killing fleecing border jumpers. They are not there to keep the peace, or prevent border jumping, but to make money.  In 2011 we were giving a lift to ZRP personnel from Maramani area into town and they made us stop when we passed border jumpers who tried to flag us down for a lift.  The police got out and fined each of them R100 (and in one case R200 to a man carrying a roll of wire). The money went straight into the ZRP pockets, and no ticket issued.  Roadblocks are a nightly occurrence on the road to Shashi where border jumpers are fleeced. Taxi drivers could be in cahoots.', '2012-06-02 01:43:00', 1, 1, 0, '2012-06-02 08:55:32', NULL, '2012-06-03 04:28:20', 2, 7),
(44, 44, 1, 'en_US', 1, 'corruption', '1) I had to pay more than normal charges for a quick passport release in 2009\n2) for police to follow up burglary 2010\n3) to keep my council stand i had to pay extra someone to avoid it being repossesed', '2012-06-01 13:45:00', 1, 1, 0, '2012-06-01 18:54:49', NULL, '2012-06-02 06:12:29', 2, 7),
(45, 45, 1, 'en_US', 1, 'PROPERTY DEVELOPERS', 'I BOUGHT 2 STANDS,ONE IN RUWA AS CESSION AND THE OTHER IN RYDALE RIDGE FROM 2 DIFFERENT DEVELOPERS BACK IN 2005 AND 2007 RESPECTIVELY.THE RUWA PROPERTY,WE WANTED TITLE DEEDS DAMAFALLS THRU THEIR LAWYERS SAID I NEED TO CLEAR TITLE DEEDS WITH RUWA BOARD,I DID WENT BACK AND THEY SAID THEY SUBMITTED.AFTER 3-9MONTHS,THEY SAID THERE IS A BACKLOG.I HAD TO GO TO DEEDS OFFICE AND WAS TOLD THESE COMPANIES HAVE ARREARS IN CAPITAL GAINS ON THESE PROPERTIES,SO UNTIL THEY PAY,THAT''S WHEN DEEDS OFFICE CAN PROCESS THE TITLE DEEDS FOR ME.BOTH PROPERTIES IS THE SAME FACT.I WROTE THIS AS AN ALERT TO ALL WHO ARE WONDERING WHY ITS TAKING AGES TO GET TITLE DEEDS WHEN WE PAID CASH FOR THE PROPERTIES.', '2012-06-01 13:49:00', 1, 1, 0, '2012-06-01 19:04:18', NULL, '2012-06-02 06:09:41', 2, 7),
(46, 46, 1, 'en_US', 1, 'December 2011', 'Needed a passport. I was from the diaspora and didnt want the hassle of waiting impatiently in the queues in and outside Makombe buildings. Asked a local friend and was reffered to a youngman Brighton who works in the passport office. It was processed with alarming speed and i got my document in 2 days. But after i parted ways with a cool USD100 ontop of 250USD processing fees and 3usd to buy the form.', '2012-06-01 13:20:00', 1, 1, 0, '2012-06-01 19:27:03', NULL, '2012-06-02 06:19:48', 2, 7),
(47, 47, 1, 'en_US', 1, 'paid bribe for my lost baggage', 'landed at harare airport on 10 dec 2009 with my wife and kenya airlines had lost our baggage.When we went to collect them a wk later, the zimra officer asked us to pay $50 for drink\n  because my wife didn''t bring her passport, she is european and the baggage were in my name. We drove all the way from kwaBulawayo.', '2009-12-10 22:30:00', 1, 1, 0, '2012-06-01 20:22:10', NULL, '2012-06-02 06:24:18', 2, 7),
(48, 48, 1, 'en_US', 1, 'traffic police', 'February 2012,South of Hre on the Bietbridge rd, traffic cops asked for $200 ticket fine and accepted $20 with no ticket written, we felt the speed on the radar was from another car.  Further down the highway pulled over again this time in a slow 60km area traffic area nearing a village.  This time cop fished for a bribe but I explained I had just paid one up the road and I was out of cash, he let me continue my journey.\nZambia was the same lots of bribes by traffic cops.', '2012-06-02 01:05:00', 1, 1, 1, '2012-06-02 02:14:24', NULL, '2012-06-02 06:06:20', 2, 7),
(50, 50, 1, 'en_US', 1, '8 minutes to answer 25 questions', 'Beitbridge VID test centre - candidates for Learners Drivers Licences are given EIGHT MINUTES to answer 25 multiple choice questions.  It is not a test of a leaner-drivers knowledge, but how fast you can read.  At $20 per test, VID is raking it in, failing people over and over again.\nHow much time are candidates supposed to be given?? Most candidates are not 1st language English speakers.  It takes time to understand questions and to choose correct answers.', '2012-06-02 01:58:00', 1, 1, 0, '2012-06-02 09:05:17', NULL, '2012-06-03 04:25:45', 2, 7),
(51, 51, 1, 'en_US', 1, 'Commissioner of Oaths ZRP', 'I have twice sent a member of staff to have Birth Certificate and ID documents certified as true copies by ZRP for NSSA Claim purposes - last week in Bulawayo, and two days ago in Beitbridge. Both times, the member of staff concerned was turned away.  In Byo, he was told he needed a payslip.  Since when is it a requirement to have a payslip when asking for documents to be certified?  In Beitbridge, they just couldn''t be bothered, and it was suggested that he would need to pay something to get it done.  In the end, he managed to get some documents done, but not others. ALL WE NEEDED were certified copies.  The public has a right to expect this service from them, and it should be given without hindrance of any kind.', '2012-06-02 12:06:00', 1, 1, 0, '2012-06-02 12:43:11', NULL, '2012-06-03 04:24:34', 2, 7),
(52, 52, 1, 'en_US', 1, 'My story', 'I was at the Arundel Shops in Harare early in May, when the policeman stopped me at my vehicle and demanded to know why it was not showing the ''third number plate.''  I had no idea it was supposed to show it, as I told him in vain.\n \nHe said I would have to pay a fine of $250 (unlikely, I thought) and impound my vehicle (I had no idea if this was true, but was obviously unable to leave without his permission.  After much argument it was clear he wanted a bribe, and threatened the penalty mentioned above unless I paid up.  In the end I had to pay him $20 and promise not to tell his boss, as I could see no other way of getting out of this predicament.', '2012-06-01 01:20:00', 3, 1, 0, '2012-06-03 04:39:20', NULL, '2012-06-07 11:07:54', 2, 7),
(53, 53, 1, 'en_US', 1, 'Zimbabwean Passport', 'Hi there,\n\n I left Zimbabwe in January 2000 to gain some global experience.\n\nIn 2005 my Zimbabwean passport expired and when I tried to renew it I was informed that because I had been out of the country for more than four years and that both my parents were born in South Africa I was not entitled to a Zimbabwean passport.\n\nI had no choice but to apply for New Zealand citizenship to get a passport in order to travel. I have since lived and worked in Scotland, New Zealand and Australia and feel that I am now ready to return home to Zimbabwe where I can pass on some of the experience that I have gained over the last twelve years.\n\nWith the onset of the Global Political Agreement I was recently put in contact with a lady in Zimbabwe by the name of Sharon whom I was informed could renounce my New Zealand citizenship and renew my Zimbabwean passport. I forwarded my expired Zimbabwean passport, my Zimbabwean citizen ID card and paid US$1300.00 for the service.\n\nI made all the necessary plans to leave Australia for Zimbabwe including getting quotes from Clover Leaf Motors for a vehicle so that I would have transport once I arrived home.\n\nI am informed that my passport was processed at KG6 barracks but sadly once it was collected by a friend of mine in Harare it was found to have a forged signature and contained finger prints that I never submitted.\n\nIn fear I immediately cancelled my plans to return home and my friend in Zimbabwe reported the new passport lost to her local police station although she still has the forged passport in her possession.\n\nPlease can you advise if anything can be done to rectify my situation as I am a born and bred Zimbabwean and have never ever had any problems with my fellow country men and woman.\n\nThanks and best regards,\n\nDave Van.', '2012-06-01 13:20:00', 3, 1, 1, '2012-06-03 04:53:40', NULL, '2012-06-07 11:09:14', 2, 7),
(54, 54, 1, 'en_US', 1, 'I BRIBED ZIMRA, POLICE AND VID', 'ZIMRA OFFICIALS INSISTED MY GOODS WERE BEYOND THE LEGAL REQUIREMENTS. They were just clothes, but the guys take out their books and calculators and try to intimidate you into believing their figures. To avoid the hustles, just gave him $20 (USD). He knew I knew he was bluffing, but you cant get a senior to support you. The guys (including the seniors) will laugh and point you out as "munhu anonyepera kudakuziwa" simply because you are from overseas.\n\nThe Police, the moment you give them your foreign registered licence, they want you to drive them to the station to verify your identity. You are in a hurry, he is not. You could be many km from home and low on fuel, he tells you unless you drive him, you will not be released. To avoid the hassling, just give him $20.\n\nI got my licence on the 5th attempt. Earlier attempts I had driven very well, but no envelopes changed hands.\nThe moment envelopes changed hands I got my licence.\nInstrctor paid the guy\nCant remember who Instructor was.\nInpector was a Mupositori from Eastly in Hre.', '2012-06-01 15:33:00', 3, 1, 0, '2012-06-03 05:10:24', NULL, '2012-06-07 11:09:37', 2, 7),
(55, 55, 1, 'en_US', 1, 'what an example for young adults', 'It''s a minor case but the essence is in the upbringing of the next generation of Zimbabwean citizens. I picked my 16 year old boy from school. We were rightly caught not to really stop at stop sign and both of us ‘forgot’ to have our seatbelts on. \nA fine of 20$ was due. The officer with the carbon paper book offered a discount of 10$ if I don’t need a receipt. I agree and paid. That were the MY ‘crime’ starts. \nBeing a retiree of European origin and permanent resident of Zimbabwe with a licence issue date 50 years ago I should know better. All the time on our trips to school I point out the rowdy, cheeky, highway-code ignoring driving behaviour of other fellow road users.\nAll my efforts to ‘teach’ my son the do’s and don’ts of rightful (road) behaviour are now null and void because he observed keenly what his ‘old man’ was doing: Bribing in broad daylight to save a few bucks!\nDisgusting!', '2012-06-03 10:32:00', 1, 1, 0, '2012-06-03 10:54:21', NULL, '2012-06-03 11:27:58', 2, 7),
(56, 56, 1, 'en_US', 1, 'Corruption by police Traffic sections.', 'Due to the nature of my job, i travel a lot. i have realised that chihuri sends the police at roadblocks to do the work in order to reduce road accidents. but instead, these officers go on the road to fill their pockets with bribe money. for example go to a roadblock at nguboyenja flyover along luveve road in bulawayo. the officers there collect bribe money in full view of members of the public. i have a lot of friends in the police. i talk to them about what happens at these roadblock. one told me that the juniors are given targets to raise bribe money daily by their bosses. he further told me that the bosses protects the juniors in case a report is made. recently an anti corruption team was launched by police provincial command. this team is just a toothless dog as it has not made significant arrests. i am reliable informed that this team was given strict instructions not to visit roadblocks manned by traffic section without prior notice. the reason is\n that once the traffic section command is notified of an impending visit, they advise their members to be cautious. if there are any authorities out there who wish to make some arrests, please do not advise the police commanders of the station concerned because they will advise their juniors. i am further informed that these officers are now getting even assistance from the local courts where cases are being dealt with in favour of the one who is ready to part with a substantial amount of money.', '2012-06-03 14:41:00', 3, 1, 0, '2012-06-03 21:07:28', NULL, '2012-06-07 11:07:15', 2, 7),
(57, 57, 1, 'en_US', 1, 'Good initiative', 'I think this is a great initiative...but I wonder how you can link it to social networking profiles like Facebook where nearly everyone is going to?\nAlso I am not sure how you say yo will protect the reporter s identity when you are asking for names and there is a security code.This is Zimbabwe and we are hard to trust anybody.', '2012-06-01 08:40:00', 3, 1, 1, '2012-06-04 06:45:58', NULL, '2012-06-07 11:08:22', 2, 7),
(58, 58, 1, 'en_US', 1, 'Updates on action taken', 'I would like to congradulate the brains behind this whistle-blowing site. Under normal circumstances, this project was supposed to have been launched by the law enforcement agency if ever they had the will to eradicate corruption. The advent of this project will see more corrupt individuals being exposed. I would like to know as to what action do you take upon receipt of the information besides publishing on this site. It will be much interesting and encouraging if the action taken and results are also published on the site. Keep up the good work.', '2012-06-03 23:05:00', 3, 1, 1, '2012-06-04 06:47:05', NULL, '2012-06-07 11:06:44', 2, 7),
(59, 59, 1, 'en_US', 1, 'A job well done', 'Keep up the good work my brother. This has been long overdue.I however wish if it could be extended to all areas.\n\nWell done\n\nKind regards,\nShepherd', '2012-06-01 15:42:00', 3, 1, 1, '2012-06-04 06:49:08', NULL, '2012-06-07 11:10:10', 2, 7),
(60, 60, 1, 'en_US', 1, 'Another supporter', 'i hope not to waste valuable space on the website but after reading some of the nonsensical comments on newzimbabwe.com where I found out about this website, I felt you could use the support and assurance of a sober and irrate Zimbabwean who has had to live through the rot of corruption in our systems in particular on the roads. I strongly believe this platform will be very usefull in steering us back to a system where people voluntarily comply with the law and in case of breach, penalties are effected fairly.', '2012-06-01 09:55:00', 3, 1, 1, '2012-06-04 06:51:26', NULL, '2012-06-07 11:08:51', 2, 7),
(61, 61, 1, 'en_US', 1, 'Best Website - Holiday Bribery South Africa to Zimbabwe', 'Hi. Thank you so much. This idea was ringing in my mind over and over again. Now its there for us to use. EXCELLENT.\nTravellers to and from South Africa are paying bribes everyday on Harare to Beitbridge Road. On any day there are about 6 - 10 speed traps at 60km/hr. \nFirstly the roads are not marked properly \nSecondly there is nothing you can do to dispute the speed even if you are travelling below 60km/hr.\nYou can easily pay bribes to these cops and go free for lesser amount. I have done is many times. These police officers are accepting bribes and they are soliciting it in day light.', '2012-06-04 10:53:00', 1, 1, 0, '2012-06-04 10:58:51', NULL, '2012-06-04 12:04:20', 2, 7),
(64, 64, 1, 'en_US', 1, 'Traffic cops', 'No I didn''t pay the bribe. But the traffic police with camera stopped me "for speeding at 86k.p.h." I informed them that no way was this true as my vehicle simply cannot go over 70k.p.h. They tried their luck for a while but knew they were caught out here so let me go.\nWhoever said cameras don''t lie have not tested ZRP ones!', '2012-06-06 05:56:00', 3, 1, 0, '2012-06-06 09:04:29', NULL, '2012-06-07 11:06:22', 2, 7),
(65, 65, 1, 'en_US', 1, 'Bulawayo  Home Affairs Office', 'Good Evening,\n\n                      I saw your site advertized on Face Book by Peter Goodwin..,so thought I would write to you ans relate " my story "..\n\nI returned home to Bulawayo from South Africa in 1999,to work for a mining company,Gunquip,who specialized in " Mine Under Ground Support Systems "..\n\nWhilst applying for a " work permit " I dealt directly with the chief Immigration Officer,Mr Sydringham Madzudzo..who promised me that he could sort out a work permit in no time at all,and with out any hassels,as he knew the head of the Home Affairs Department in Harare..BUT !!!??? it would cost me R300.00.\n\nSo to avoid any hassels,and to secure a work permit,I handed over the money to him..\n\nRoughly 3 weeks later he contacted me in South Africa and told me my " Work Permit " was ready for collection from his office..,but I was required to collect it personally.\n\nI returned to Bulawayo a few days later..,and was told by Mr Madzudzo that as a gesture of Good Will,the Chief Immigration Officer in Harare had processed the permit quickly..,and wanted R250.00 for doing so.\n\nI was then given my Work Permit after handing over the money..\n\nWhen I renewed my work permit in 2002,I had to give Mr Madzudzo " A Cash Gift "..\n\nIn 2005 when my permit was up for renewal,I was also elegible to apply for Returning Residence Status,which I did..\n\nSadly,it was going to cost me 10,000 bricks and 100 bags of cement,which would be donated to the Seventh Day Adventist Church on the Johannesburg road,Mr Madzudzo was the assistant pastor at the Church I think..,the expense was too much..,so I had no option but to leave Zimbabwe...\n\nThat ismy story about having tp pay bribes...,Darryl Leith', '2012-06-06 22:14:00', 3, 1, 0, '2012-06-07 06:39:38', NULL, '2012-06-07 11:05:10', 2, 7),
(66, 66, 1, 'en_US', 1, 'Bribe paid to obtain drivers license', 'Been driving for 21 years, but have to re-take drivers license in SA as had been outside of SA for 10 years and hadn''t converted my license. Was told by the examiner that I wouldn''t pass without paying a bribe. R1800 to get my drivers license.', '2010-10-01 01:25:00', 1, 1, 0, '2012-06-07 08:31:33', NULL, '2012-06-07 10:28:25', 2, 15),
(67, 67, 1, 'en_US', 1, '#IPaidABribeInZimbabwe', '#IPaidABribeInZimbabwe by the Passport Offices in #Bulawayo', '2012-06-06 11:06:00', 4, 1, 0, '2012-06-07 10:51:48', NULL, NULL, 2, 7),
(72, 72, 1, 'en_US', 1, 'ZIMRA Plumtree Border Post Inflating Cars Prices', 'ZIMRA officials at Plumtree border posts are disregarding the invoices we submit when clearing our ExJaps and they inflate prices so that we can "negotiate" and bribe them. I had to bribe on guy named "sting" with $100 after I submitted my invoice totalling $2,800 and he claimed my car was worth $3,900. We even had to check on tradecarview.com for the prices and he still maintained my invoice was "too low"', '2012-06-09 13:24:00', 1, 1, 0, '2012-06-09 19:33:06', NULL, '2012-06-10 04:05:00', 2, 6),
(70, 70, 0, 'en_US', NULL, 'Traffic cops asking for ''favours''', 'Traffic cops threatening to impound a car after the Zinara extension had been retrospectively revoked, and asking for ''favours'' to make the problem go away.', '2012-06-08 09:40:00', 1, 1, 1, '2012-06-08 11:01:51', NULL, NULL, 2, 6),
(71, 71, 1, 'en_US', 1, 'Incorrect ticketing for no front number plate  (The letter speaks for itself)', 'ZRP TRAFFIC                                                                                         8 JUNE 2012\nBEITBRIDGE\n\nTO WHOM IT MAY CONCERN\n\nRE: ISUZU PICK-UP AAD 0767 registered to DIGBY J BRISTOW\n\nI am today sending my driver, Robert Makwanda, into Beitbridge to order a new number plate for the above vehicle, for which I have been fined TWENTY DOLLARS,  twice already.  On both occasions, the two different drivers had no money on them to apply for new plates, hence the delay.  \n\nI would ask that you allow him to travel to the Post Office as is, to apply for the necessary replacement of the plate.\n\nI would also like to point out that according to The VEHICLE REGISTRATION AND LICENSING REGULATIONS S.I. 94/90 c.s 11(2), which is still in force, the fine for no front plate/registration mark and number is  ONLY $10.  \n\nBoth Admission of Guilt forms we received for this offence (#’s 2532525 of 4/06/12 and 2532409 of 1/06/12) issued to our drivers state that the fines issued are for:\n\nCharge (Section and Statutory enactment): “C/S 60 (1) of the Vehicle Registration and Licencing Act”\nBrief Description of Offence(s):  “NO FRONT NUMBER PLATE”\n\nAccording to my schedule of fines the offence for c/s 60 comes in under the heading: DANGEROUS FITTINGS (CONDITIONS) etc\nc.s 60 Conditions likely to cause danger …………………… $10\n\nI would submit that either your Traffic Officers are not applying the laws correctly, or there is something amiss.\n\nI will be following this up with the Superintendent, and if necessary, the Magistrate.\n\nAny further fines for the same offence, I would rather go to court.\n\nYours sincerely\n\n\n--------------------------- \nDIGBY JOHN BRISTOW\nRegistered Owner: AAD 0767', '2012-06-08 12:10:00', 3, 1, 0, '2012-06-08 14:11:08', NULL, NULL, 2, 6),
(73, 73, 1, 'en_US', 1, 'Zimbabwe Customs', 'On June 13, 2012 my daughter (US passport) paid her and her sister''s entry visa with $60 ($30 each).  The Customs officer took the money then proceeded to act as if he was busy, then returned and asked for the money again.  When she complained that she had already paid, he became angry, kept her passport and sent her to the back of the line. She was then forced to pay again.  No receipt was given. Be aware to pay with the exact amount and insist on a receipt before the Customs Officer leaves or tries to conduct any other business.', '2012-06-13 15:37:00', 3, 1, 0, '2012-06-14 03:04:48', NULL, NULL, 2, 6),
(87, 87, 0, 'en_US', NULL, 'Stop Sign', 'I didn''t have to pay a bribe, and got off with a "Caution" but they did accept a bribe from the vehicle stopped behind me.', '2012-06-26 13:08:00', 1, 1, 0, '2012-06-26 13:11:06', NULL, NULL, 0, 16),
(86, 86, 1, 'en_US', 1, 'CLAMPERS', 'MAN BY THE NAME MOYO CLAMPED MY VEHICLE SAYING MY DISC,WHICH WAS VALID,WAS ON THE WRONG SIDE OF THE DASH BOARD.HE MADE ME PAY $25.00 SAYING THE TICKET WAS OF VALUE $57.00\nWHAT CAN WE DO TO HAVE SUCH CORRUPT AUTHORITIES DELT WITH??', '2012-06-22 10:04:00', 1, 1, 0, '2012-06-22 10:08:50', NULL, '2012-06-28 07:01:33', 2, 6),
(88, 88, 0, 'en_US', NULL, 'Traffic Cop Bribe', 'I paid a bribe to a cop to avoid a court sentence for apparently breaking the law by turning against a red traffic light.', '2012-06-28 13:45:00', 1, 1, 0, '2012-06-28 13:51:27', NULL, NULL, 0, 2),
(89, 89, 0, 'en_US', NULL, 'Fire Extinguisher, reflector triangle & bib', 'can the responsible authorities tell the nation the position on the harassment drivers are getting from the police for not having a SAZ certified fire extinguisher, reflector triangle and bib. last week a police officer demanded my car keys for not possessing the above. is this lawful or they are just trying to make money with us.', '2012-07-04 01:27:00', 1, 1, 0, '2012-07-04 08:38:02', NULL, NULL, 0, 6),
(90, 90, 0, 'en_US', NULL, 'Disconnection', 'The link says it all.', '2012-07-04 13:27:00', 1, 1, 0, '2012-07-04 14:29:50', NULL, NULL, 0, 6),
(102, 122, 0, 'en_US', NULL, 'commuter bus accident near rusape', 'hi, my wife was involved in a commuter bus accident near rusape on her way to mutare from harare on 24/08/2012 @ 15.00hrs, she had a broken arm, deep cuts on the head and elbows. police arrived at the scene and went through her handbag. they took abt $300, mobile phone, wedding rings, camera from her handbag, all gone. the people who are meant to enforce the law dipped their hands into her handbag. thank GOD my wife is alive and recovering well.', '2012-09-25 13:15:00', 1, 1, 1, '2012-09-25 21:18:33', NULL, NULL, 0, 11),
(92, 92, 0, 'en_US', NULL, 'Public drinking', 'I was arrested for public drinking on Friday and spent the night at central police station in town because I did not have the $20 fine then. My brother then came on Saturday morning to pay the fine so that I was released but they let me go after he paid a $10 bribe', '2012-07-14 23:29:00', 1, 1, 0, '2012-07-16 12:37:05', NULL, NULL, 0, 17),
(93, 93, 0, 'en_US', NULL, 'traffic police', 'esigodin traffic police, was on holiday recentaly at 2am left bulawayo to get to zvishabane, l was doing 80km caught paid 20us as bride on my way back at 1 am l knew whre the police were l completely reduced my speed to 40km they stopped me and said l was over speeding l was shown a gun with 75km, the funniest thing, ahead of me were two cars parked l could hear one of the police saying wanka uchimanya  doing 75km so was car number 2,and 3 in the end l parted away with 20us. Doggy gun hey....... all cars doing 75km', '2012-07-19 01:31:00', 1, 1, 0, '2012-07-19 03:40:43', NULL, NULL, 0, 6),
(94, 98, 1, 'en_US', 1, 'Police takes bribe and ignitions keys from Kombi driver', 'At around 11 am this morning, a BMW police car stopped the kombi I was in along Mt. Pleasant road. The driver got out and before he was charged with anything he took $10 bill from his pocket and gave it to the police officer. I did not hear what the police officer said but he went on switch off the kombi and remove the ignition keys. We had to finish the rest of the journey on foot. \n\nAre police officers allowed to do this? Are all kombi drivers always guilty of breaking some law?', '2012-07-24 12:40:00', 1, 1, 0, '2012-07-24 12:42:21', NULL, '2012-07-24 13:43:26', 2, 6),
(99, 105, 0, 'en_US', 1, 'I paid a bribe with a flash stick', 'I was having drinks at londoners with a couple of friends. As we left the bar and walked towards the car, we walked past a group of police officers and never stopped to think that each of us were drinking. Public drinking actually. The police officer who stopped us reminded us that we were public drinking but because he was already trying to arrest somebody else, he called one of his colleagues to come and deal with us. Here is the funny part, the colleague didn''t stop us or try to arrest us. He walked us to the car and one of my friends said in a joking way that we had been caught red handed and we all laughed. Including the police officer. \nI then told the police officer that we did not have any money to bribe ourselves out of this situation. He said that he understood that we did not have any money but he reminded us that he was not the one who caught us, and that all his other colleagues (I think they were 5 or 6) could see him with us so it was not going to look good for him to go to back to the group empty handed. He had a strong case. I put my hand in my right pocket, hoping to find some lose change, I found a flash disk so I pulled it out and offered it to him. He hesitantly accepted it. I went on to tell him that it''s an 8 gig flash disk (it was actually 4 gig). He asked what kind of music was on it. I said that I don''t remember but I know there is Winky D. He said that we can go', '2012-08-03 01:18:00', 1, 1, 1, '2012-08-07 08:30:40', NULL, NULL, 0, 6),
(100, 116, 0, 'en_US', NULL, 'Hanzi fire extinguisher rako harina pressure yakakwana', 'Ndakamiswa pa roadblock. Mupurisa wacho akamboda kuedza kutsvaga mhosva but yakanetsa kuwana. Akazoyerekana abvunza fire extinguisher ini ndokuiburitsa. Mushure mekuiongorora akabva anditaurira kuti fire extinguisher yako haina pressure yakakwana. Akundinetsera fine, ndakazongomupa $2 kuti ndione kuenda. Asi fire extinguisher inganzi haina mweya wakakwana here akomana?', '2012-08-27 13:22:00', 1, 1, 0, '2012-08-27 17:25:27', NULL, NULL, 0, 6),
(101, 121, 0, 'en_US', 1, 'Seat Belt', 'I was caught with no seat belt. so was my girlfriend who was seated at the passengers side. I ended up paying a $5 bribe so that we don''t pay the $10 per person the officer was going to charge me for', '2012-09-16 13:22:00', 1, 1, 0, '2012-09-16 16:38:52', NULL, NULL, 2, 6),
(103, 123, 0, 'en_US', NULL, 'Why pay and complain later, dont even pay the bribe be a responsible citizen', 'I think an initiative that red handedly catches people is what we want not this story tellin platform we need a toll free and a hotline that quickly responds, who knows some mayb mere allegations> Ofcourse almost  everyone has paid a bribe and most of u out there have received a bribe too. Stop paying  bribe and be a responsible citizen.', '2012-09-27 13:01:00', 1, 1, 0, '2012-09-27 13:10:09', NULL, NULL, 0, 6),
(104, 124, 0, 'en_US', NULL, 'Officer asking for "Amount" Bride', 'Was in a kombi from town just about the banks in Southerton and about to turn into Birmingham from town, a highway patrol Officer coming form the other direction instructed the conductor in our kombi to come down and pay (We were stopped by a robot". I was surprised since no inspection of the vehiicle had been carried out since the Officer was on the other side of the road, his vehicle parked by the side. I took a picture of the Officer signaling the conductor to come down. The conductor obliged, paid the Officer his "dues" and we continued with our journey. ZRP has become so corrupt', '2012-10-04 13:00:00', 1, 1, 0, '2012-10-04 16:08:35', NULL, NULL, 0, 6),
(105, 125, 0, 'en_US', NULL, 'City Council', 'I parked my car in front of shops that are close to Builder''s home in Harare''s Rezende street on the 10th of September. After 10 minutes the City Council crook clamped my car even through there were people inside...my children were there. When I approached the city council crook, he told me that the fine was USD57 and was supposed to be paid at this other place close to Nasa!!!..I did not have that time so I negotiated for me to pay and have a ticket of the amount to be paid..a spot fine. He refused initially. I insisted and he asked me to get into one of the shops for " payment" where I handed over USD60 to him and he returned USD 20 to me as change ..meaning USD 40 was paid. Where is the money going with no receipt?', '2012-10-04 22:11:00', 1, 1, 0, '2012-10-04 22:17:48', NULL, NULL, 0, 6),
(106, 126, 0, 'en_US', NULL, 'cop takes avocados for a bribe', 'Back in 2008 I was travelling from visiting Mutare with my mum and 2 younger brothers (1 of them driving, with my mum in the back seat) when we were stopped by police at the Mabvuku Turnoff roadblock as we entered Harare. It was around 7pm and it was quite dark and so the cop approached us and asked my Brother "Maswera sei Shefu munga batidza light) meaning "How was your day ,can you turn on the interior Lights" so he can see inside. So we did. \n\nHere''s the funny part. After taking a look inside the car the first thing that came out of this cop''s mouth was  " Munoziva hatizi kusungana and hapana chamakanganisa asi ndirikukumbirawo mari" (You know that Im not going to arrest or ticket you but Im just here to ask you for money". At that time we really did not have any more money on us as we used the money along the way on fuel and the other 4 or so roadblocks we encountered but this was the best of them all.\n After going back and forth trying to negotiate some money we finally showed him Avocados that we had and offered him a few which he was more than happy to accept.\nHe thanked us and wished us a safe trip. Nice honest guy though', '2012-10-07 01:08:00', 1, 1, 0, '2012-10-07 05:35:15', NULL, NULL, 0, 6),
(107, 129, 0, 'en_US', NULL, 'Failure to stop at STOP sign', 'The cops here are asking for bribes for failure to stop at the STOP sign. At times when you pay the $20 ''fine'', they will write you a admission of guilt on one that was already filled out so that they pocket the change.\n\nMy opinion is these cops should be deployed elsewhere where they can actually be of use. There is increased crime. Why don''t they make frequent night patrols as we have seen increased crime spates this year in the whole Borrowdale area?', '2012-10-14 13:01:00', 1, 1, 0, '2012-10-16 09:08:54', NULL, NULL, 0, 13),
(108, 131, 1, 'en_US', NULL, 'Bribe', 'Whislt driving along Hre Mutare Rd near Macheke on Sunday 7/10/12 at about 7am, 2 Pollice officers pulled me off the road and alledged that I was overspeeding, yet I was not, my speedo meter read 68km/hr but they showed me a reading of 98km per hour (the same reading was showed to my brother who had been driving ahead of me). Because I had no money on me as my bags were in the the car which was ahead they 2 police officers asked that I give them some of the drinks in the cooler box and still issued me a ticket for $15. A female police officer was present. What a shame to our Zimbabwean culture.', '2012-10-25 13:31:00', 1, 1, 1, '2012-10-25 13:44:05', NULL, '2012-11-04 21:47:12', 2, 6),
(109, 133, 1, 'en_US', NULL, 'Abuse of authority by Police', 'Last week some police officers driving a maroon Hyundai Excel Reg # ABY 9299 duped a vendor at the robots at Rothmans. one of the officers said he wanted to buy  mutton cloth so the vendor gave the passenger and the officer who was driving the car proceeded against a red robot and sped of without paying.', '2012-10-31 13:37:00', 1, 1, 0, '2012-10-31 17:55:35', NULL, '2012-11-02 12:19:30', 2, 6),
(110, 138, 0, 'en_US', NULL, 'Borrowdale Police', 'On Ridgeway North. Paid a bride of US$12 (all we had) because our fire extinguisher was one month out of date.', '2012-11-10 23:54:00', 1, 1, 0, '2012-11-10 23:58:10', NULL, NULL, 0, 6),
(111, 140, 0, 'en_US', NULL, 'Theft', 'When a person in authority accepts a bribe it is the same as a criminal stealing.', '2012-11-28 13:17:00', 1, 1, 0, '2012-11-28 21:19:40', NULL, NULL, 0, 6),
(112, 141, 0, 'en_US', NULL, 'VID', 'I have written my provisional road test 8 times now. The first time I wrote was in Marondera and I passed first time without having to pay a bribe! I let it expire and wrote in Harare the last 7 times. The last time i wrote, i was approached and told that because I am white, i must pay a bribe and $100.00 would guarantee me a pass. I still failed.', '2012-08-12 07:30:00', 1, 1, 0, '2012-11-30 08:24:19', NULL, NULL, 0, 2),
(113, 143, 0, 'en_US', NULL, 'CANTER', 'i was driving a empty canter 3tonne and was stopped 4 times on the bulawayo gwanda high way. i paid for not havin a licence class 2 and a refective jacket . i left on overage 6$ on each stop.', '2012-12-05 13:18:00', 1, 1, 0, '2012-12-05 13:24:10', NULL, NULL, 0, 8),
(114, 148, 0, 'en_US', NULL, 'I take a bribe', 'I always charge a bribe because I need to send my children to school.  I work very hard and do not get enough money from my boss, so I make money like english businessman.', '2012-12-20 01:02:00', 1, 1, 0, '2012-12-20 09:04:31', NULL, NULL, 0, 12),
(115, 149, 0, 'en_US', NULL, 'Failure to stop at STOP sign', 'Failure to stop at STOP sign at Durban and East road', '2013-01-23 01:10:00', 1, 1, 0, '2013-01-23 04:17:30', NULL, NULL, 0, 15);
INSERT INTO `incident` (`id`, `location_id`, `form_id`, `locale`, `user_id`, `incident_title`, `incident_description`, `incident_date`, `incident_mode`, `incident_active`, `incident_verified`, `incident_dateadd`, `incident_dateadd_gmt`, `incident_datemodify`, `incident_alert_status`, `incident_zoom`) VALUES
(116, 150, 0, 'en_US', 1, 'Inoita here iyi akomana', 'I was arrested for public drinking at around 10:50pm yesterday. Chakanyayondirwadza ndechekuti ndanga ndiri mu raini mangu ndichizvifambira zvangu ndichienda kumba. \n\nNdakatozoburitsa $3 ndichipa mupurisa  wacho ndaona kuti ndinogona kutorara mujeri ndikatadza kuenda kubasa.\n\nAsi akomana, yekusungirwa public drinking mu raini inoita here?', '2013-03-13 13:43:00', 1, 1, 0, '2013-03-13 15:49:20', NULL, NULL, 2, 6),
(117, 153, 0, 'en_US', NULL, 'I saw a kombi driver pay a bribe', 'I was sitting next to the driver in a Kombi that was getting into town from Waren Park. We were stopped at a road block around the Belvedere area. the kombi was over capacity and the police officer who stopped us walked to the drivers window and said: "yakazara ka iyi?". \nThe forced a smile and said "sorry mdara. asi batai neapa" as he handed what i think was a $5 note. \nI didn''t want to be caught looking so I wasn''t able to see clearly how much it was. But I could see that it was folded.\nI think I am the only one in the Kombi who heard and saw what happened.', '2013-03-15 13:00:00', 1, 1, 0, '2013-03-15 14:12:33', NULL, NULL, 0, 6),
(118, 155, 0, 'en_US', NULL, 'Getting my car cleared duty free', 'I recently imported an car from Mesina. My clearing agent helped me get it in from the without paying duty because he paid an official to make it look like it was a diabled person who was bring it in.\nBut the down side is that I won''t be able to change ownership for a few years.', '2013-03-17 23:54:00', 1, 1, 0, '2013-03-17 23:58:05', NULL, NULL, 0, 6),
(119, 156, 0, 'en_US', NULL, '$120 to get a one day passport', 'I had to fork out $120 to get a one day passport at Makombe offices.', '2013-03-20 01:58:00', 1, 1, 0, '2013-03-20 05:00:51', NULL, NULL, 0, 6),
(120, 161, 0, 'en_US', NULL, 'Paid $6 bribe to avoid geting arrested for public drinking', 'I was at a bar in Zengeza 5 yesterday watching the soccer game with a friend. After the game, we bought a couple of beers to take home and started drinking them as we walked home - our house is just a few minutes walk from the bar. \n\nThe time was just a little after midnight so all the roads were quiet. We ran into 3 police offiers. I remember that one had a significantly bigger build than the other two. They mentioned that they were on their way to St. Mary''s police station. They told us they were going to charge us with public drinking.\n\nI don''t know if what they did was legal but they searched us. They claimed that they were searching for Marijuana but I really think they wanted to find out if we had any money on us bcoz when the one who was searching me came across a pocket which had money, he dwelled there for a while and asked what it was - like he didn''t know.\n\nThey told us that if we didn''t each have a $10 fine for public drinking, we would spend the night in a cell and will stay there until we were taken to court. My friend had no money on him (fortunately).\n\nI was starting work early the following morning, I had no option. I just offered them the $6 bribe they seemed to be waiting for.\n\nIs it public drinking when you are just a few blocks from your house? And in the middle of the night? Mu raini rako here amana?', '2013-04-10 00:20:00', 1, 1, 0, '2013-04-11 16:23:34', NULL, NULL, 0, 12),
(121, 163, 0, 'en_US', NULL, 'Late Amber', 'i paid $10 to the police for entering an intersection with a traffic light on amber.', '2011-06-15 13:56:00', 1, 1, 0, '2013-04-25 12:40:24', NULL, NULL, 0, 6),
(122, 164, 0, 'en_US', NULL, 'Drivers licence', 'paid $100 for a class four drivers licence.', '2013-04-25 12:40:00', 1, 1, 0, '2013-04-25 12:42:08', NULL, NULL, 0, 6),
(123, 166, 0, 'en_US', NULL, 'Mother intimidated and bribed on 2nd St Ext.', 'My mother was stopped by cops just after she turned off Josiah Tongogara onto Sam Nujoma (2nd St).  They had stopped others, so traffic was backed up and she had to swerve slightly to avoid the line.  Three policemen approached her together, shouting "We are 3 witnesses and we saw you driving erratically."  This went on for a while until she finally gave in and just asked what they wanted.  Pulling a $20 out of her purse, she handed it to them - one of them said "That''s not enough - we want $50!"  She refused and stood firm.  Cheeky sods.  I called the National Complaints Hotline (04 703631) - they thanked me curtly without asking for more details and then hung up.', '2013-04-12 11:30:00', 1, 1, 0, '2013-04-30 20:55:07', NULL, NULL, 0, 15),
(124, 168, 0, 'en_US', NULL, 'Paid $5 to jump the queue for the car licensing at post office', 'At the terribly long queue at Borrowdale Post Office we paid $5 to give to an officer who received the papers in a envelope at the back door to then process the license ahead of many other people.', '2013-06-04 13:28:00', 1, 1, 0, '2013-06-04 15:34:04', NULL, NULL, 0, 6),
(125, 169, 0, 'en_US', NULL, 'CITY PARKING', 'I WAS VICTIM TO A PARKING MARSHAL WHO INSISTED I PAY HIM FIVE DOLLAR ($5) FOR THE DAY AS I HAVE A BUSINESS ALONG ABECORN STREET HARARE AND AM PARKED FOR LONG PERIODS OF TIME.ACCORDING TO THIS MARSHAL WHO IDENTIFIED HIMSELF AS TAFADZWA AN WAS KIND ENOUGH TO GIVE ME HIS CELL NUMBER SAYING IF I GET INTO ANY PROBLEMS WITH HIS GUYS I AM FREE TO PHONE HIM,IT IS CHEAPER FOR ME TO PAY HIM THAN PAY THE FULL AMOUNT FOR THE DAY WHICH HE EXPLAINED WOULD AMOUNT TO A LOT MORE THAN WHAT I AM PAYING.THIS GUY IS VERY ARROGANT AND VERY GREEDY.IV SINCE ARRANGED PARKING IN A SANITARY LANE OF A NEARBY SHOP AS THIS MARSHAL CONTINUOUSLY HASSLES US FOR HIS MONIES.CAN ANYONE NOT ASSIST??HIS CELL NUMBER IS 0738 107 887.', '2013-06-06 12:43:00', 1, 1, 0, '2013-06-06 13:12:29', NULL, NULL, 0, 6),
(126, 170, 0, 'en_US', NULL, 'CITY PARKING', 'I WAS VICTIM TO A PARKING MARSHAL WHO INSISTED I PAY HIM FIVE DOLLAR ($5) FOR THE DAY AS I HAVE A BUSINESS ALONG ABECORN STREET HARARE AND AM PARKED FOR LONG PERIODS OF TIME.ACCORDING TO THIS MARSHAL WHO IDENTIFIED HIMSELF AS TAFADZWA AN WAS KIND ENOUGH TO GIVE ME HIS CELL NUMBER SAYING IF I GET INTO ANY PROBLEMS WITH HIS GUYS I AM FREE TO PHONE HIM,IT IS CHEAPER FOR ME TO PAY HIM THAN PAY THE FULL AMOUNT FOR THE DAY WHICH HE EXPLAINED WOULD AMOUNT TO A LOT MORE THAN WHAT I AM PAYING.THIS GUY IS VERY ARROGANT AND VERY GREEDY.IV SINCE ARRANGED PARKING IN A SANITARY LANE OF A NEARBY SHOP AS THIS MARSHAL CONTINUOUSLY HASSLES US FOR HIS MONIES.CAN ANYONE NOT ASSIST??HIS CELL NUMBER IS 0738 107 887.', '2013-06-06 12:43:00', 1, 1, 0, '2013-06-06 13:12:31', NULL, NULL, 0, 6),
(127, 171, 1, 'en_US', 1, 'Zimbabwe is the most corrupt country in the SADC', 'Zimbabwe most corrupt country in SADC region #IPABZim - #CPI2012 http://t.co/pxqtTxqt', '2012-12-06 16:00:00', 4, 1, 0, '2013-06-13 22:06:41', NULL, NULL, 2, 6),
(128, 172, 1, 'en_US', 1, 'Re: Congratulations Deployment of the Week! - I Paid of the Bribe', 'HI Folks, we have heard some things about actions against folks in civil\nsociety in Zimbabwe. Please be safe.\n\nHere are some guidelines that we created that might be helpful for you\n\nhttps://wiki.ushahidi.com/display/WIKI/Security+Resources\n\nAll the best,\n\nheather\n\nOn Fri, Oct 26, 2012 at 7:35 AM, Heather Leson &lt;hleson@ushahidi.com&gt; wrote:\n\n&gt; Congratulations! You are the Deployment of the Week! Please find your\n&gt; attached Deployment of the Week badge which you are feel to you in\n&gt; promotion.\n&gt;\n&gt; Thank you for all the hard work you are doing with:\n&gt; http://www.ipaidabribe.org.zw\n&gt;\n&gt; Some publications about this announcement:\n&gt; https://wiki.ushahidi.com/display/WIKI/Deployments+of+the+Week\n&gt;\n&gt; http://blog.ushahidi.com/index.php/2012/10/25/weekly-community-leaders-ideo-hackathon/\n&gt;\n&gt;\n&gt; Also, I wanted to let you that I will feature your work at the\n&gt; International Anti-Corruption Conference in Brazil next week:\n&gt; http://15iacc.org/\n&gt;\n&gt; If you ever need anything from us, please let us know!\n&gt;\n&gt; Heather\n&gt;\n&gt; --\n&gt; Heather Leson\n&gt; Director of Community Engagement\n&gt; *Ushahidi*\n&gt; hleson@ushahidi.com\n&gt; www.ushahidi.com\n&gt; @heatherleson\n&gt;\n&gt;\n\n\n-- \nHeather Leson\nDirector of Community Engagement\n*Ushahidi*\nhleson@ushahidi.com\nwww.ushahidi.com\n@heatherleson', '2013-02-21 16:05:00', 3, 1, 0, '2013-06-13 22:08:22', NULL, NULL, 2, 6),
(129, 173, 1, 'en_US', 1, 'Hi I am in', ' I am in Madrid Spain at the moment, I am here for a conference and I \njust had my bag stolen from me with my passport and personal effects. I \nhave been trying to sort things out with the necessary authorities, I \nneed some assistance from you. \n\n \n\n Let me know if you can be of any help.  \n\n\n\n\n\n Barbara', '2012-09-24 06:16:00', 3, 1, 0, '2013-06-13 22:10:23', NULL, NULL, 2, 6);
