(5, 0, 52, 0, 2, '<1338506425.34085.YahooMailNeo@web171506.mail.ir2.yahoo.com>', 'John Ward', NULL, 'My story', 'I was at the Arundel Shops in Harare early in May, when the policeman stopped me at my vehicle and demanded to know why it was not showing the ''third number plate.''&nbsp; I had no idea it was supposed to show it, as I told him in vain.\n&nbsp;\nHe said I would have to pay a fine of $250 (unlikely, I thought) and impound my vehicle (I had no idea if this was true, but was obviously unable to leave without his permission.&nbsp; After much argument it was clear he wanted a bribe, and threatened the penalty mentioned above unless I paid up.&nbsp; In the end I had to pay him $20 and promise not to tell his boss, as I could see no other way of getting out of this predicament.\n\n', 1, '2012-06-01 01:20:26', 0, NULL, NULL),
(6, 0, 57, 0, 3, '<20120601064047.1570.2102756184.swift@ipaidabribe.phpfogapp.com>', 'teputepu@zol.co.zw', NULL, 'Good initiative', 'Sender: Brian Teputepu\r\nEmail: teputepu@zol.co.zw\r\nPhone: 0772803854\r\n\r\nMessage: \r\nI think this is a great initiative...but I wonder how you can link it to social networking profiles like Facebook where nearly everyone is going to?\r\nAlso I am not sure how you say yo will protect the reporter s identity when you are asking for names and there is a security code.This is Zimbabwe and we are hard to trust anybody.\r\n\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~\r\nThis message was sent from your website at http://ipaidabribe.phpfogapp.com/\n\n', 1, '2012-06-01 08:40:48', 0, NULL, NULL),
(7, 0, 60, 0, 4, '<20120601075506.11311.1562830896.swift@ipaidabribe.phpfogapp.com>', 'mozmora@gmail.com', NULL, 'Another supporter', 'Sender: Moses Mora\r\nEmail: mozmora@gmail.com\r\nPhone: 0772987961\r\n\r\nMessage: \r\ni hope not to waste valuable space on the website but after reading some of the nonsensical comments on newzimbabwe.com where I found out about this website, I felt you could use the support and assurance of a sober and irrate Zimbabwean who has had to live through the rot of corruption in our systems in particular on the roads. I strongly believe this platform will be very usefull in steering us back to a system where people voluntarily comply with the law and in case of breach, penalties are effected fairly.\r\n\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~\r\nThis message was sent from your website at http://ipaidabribe.phpfogapp.com/\n\n', 1, '2012-06-01 09:55:07', 0, NULL, NULL),
(8, 0, 53, 0, 5, '<10EDF872BA7C4D4294B0B9299A6AEB6A@DvanR>', 'Dave Van', NULL, 'Zimbabwean Passport.', 'Hi there,\r\n\r\n I left Zimbabwe in January 2000 to gain some global experience.\r\n\r\nIn 2005 my Zimbabwean passport expired and when I tried to renew it I was informed that because I had been out of the country for more than four years and that both my parents were born in South Africa I was not entitled to a Zimbabwean passport.\r\n\r\nI had no choice but to apply for New Zealand citizenship to get a passport in order to travel. I have since lived and worked in Scotland, New Zealand and Australia and feel that I am now ready to return home to Zimbabwe where I can pass on some of the experience that I have gained over the last twelve years.\r\n\r\nWith the onset of the Global Political Agreement I was recently put in contact with a lady in Zimbabwe by the name of Sharon whom I was informed could renounce my New Zealand citizenship and renew my Zimbabwean passport. I forwarded my expired Zimbabwean passport, my Zimbabwean citizen ID card and paid US$1300.00 for the service.\r\n\r\nI made all the necessary plans to leave Australia for Zimbabwe including getting quotes from Clover Leaf Motors for a vehicle so that I would have transport once I arrived home.\r\n\r\nI am informed that my passport was processed at KG6 barracks but sadly once it was collected by a friend of mine in Harare it was found to have a forged signature and contained finger prints that I never submitted.\r\n\r\nIn fear I immediately cancelled my plans to return home and my friend in Zimbabwe reported the new passport lost to her local police station although she still has the forged passport in her possession.\r\n\r\nPlease can you advise if anything can be done to rectify my situation as I am a born and bred Zimbabwean and have never ever had any problems with my fellow country men and woman.\r\n\r\nThanks and best regards,\r\n\r\nDave Van.\n\n', 1, '2012-06-01 13:20:18', 0, NULL, NULL),
(9, 0, 0, 0, 6, '<20120601112229.12854.969965439.swift@ipaidabribe.phpfogapp.com>', 'munyaradzi@transparency.org.zw', NULL, 'A very good application', 'Sender: Munyaradzi\r\nEmail: munyaradzi@transparency.org.zw\r\nPhone: \r\n\r\nMessage: \r\nGood Day.\r\n\r\nI trust you are well. Could you also advise on how I can tap into your website, and also use the information for our organisation. Is it possible that I can also incorporate the this website into our website. Regards\r\n\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~\r\nThis message was sent from your website at http://ipaidabribe.phpfogapp.com/\n\n', 1, '2012-06-01 13:22:29', 0, NULL, NULL),
(10, 0, 54, 0, 7, '<1338557577.64424.YahooMailNeo@web114704.mail.gq1.yahoo.com>', 'Munyaradzi Kunaka', NULL, 'I BRIBED ZIMRA, POLICE AND VID', 'ZIMRA OFFICIALS INSISTED MY GOODS WERE BEYOND THE LEGAL REQUIREMENTS. They were just clothes, but the guys take out their books and calculators and try to intimidate you into believing their figures. To avoid the hustles, just gave him $20 (USD). He knew I knew he was bluffing, but you cant get a senior to support you. The guys (including the seniors) will laugh and point you out as "munhu anonyepera kudakuziwa" simply because you are from overseas.\r\n\r\nThe Police, the moment you give them your foreign registered licence, they want you to drive them to the station to verify your identity. You are in a hurry, he is not. You could be many km from home and low on fuel, he tells you unless you drive him, you will not be released. To avoid the hassling, just give him $20.\r\n\r\nI got my licence on the 5th attempt. Earlier attempts I had driven very well, but no envelopes changed hands.\r\nThe moment envelopes changed hands I got my licence.\r\nInstrctor paid the guy\r\nCant remember who Instructor was.\r\nInpector was a Mupositori from Eastly in Hre.\n\n', 1, '2012-06-01 15:33:00', 0, NULL, NULL),
(11, 0, 59, 0, 8, '<20120601134211.14552.1592241946.swift@ipaidabribe.phpfogapp.com>', 'mabhenas@yahoo.co.ukk', NULL, 'A job well done', 'Sender: Shepherd Mabhena\r\nEmail: mabhenas@yahoo.co.ukk\r\nPhone: \r\n\r\nMessage: \r\nKeep up the good work my brother. This has been long overdue.I however wish if it could be extended to all areas.\r\n\r\nWell done\r\n\r\nKind regards,\r\nShepherd\r\n\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~\r\nThis message was sent from your website at http://ipaidabribe.phpfogapp.com/\n\n', 1, '2012-06-01 15:42:12', 0, NULL, NULL),
(12, 0, 0, 0, 9, '<20120601152144.30185.2146607674.swift@ipaidabribe.phpfogapp.com>', 'simba.chikanza@zimeye.org', NULL, 'Sponsorship', 'Sender: Simba Chikanza\r\nEmail: simba.chikanza@zimeye.org\r\nPhone: 00447411343574\r\n\r\nMessage: \r\nDear Tawanda. \r\n\r\nI am the Business Editor of ZimEye (www.zimeye.org) and also a founding Director of publication together with another news service Zimdiaspora.com.\r\n\r\nI wanted to find out if you are in need of server resources for backup etc and whatever needs your initiative requires. We at ZimEye sponsor a number of projects and our recent is the Amakhosi Cultural Centre in Bulawayo.\r\n\r\nWarm regards,\r\n\r\nSimba\r\nsimba.chikanza@zimeye.org\r\n\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~\r\nThis message was sent from your website at http://ipaidabribe.phpfogapp.com/\n\n', 1, '2012-06-01 17:21:45', 0, NULL, NULL),
(13, 0, 0, 0, 10, '<20120602193930.18140.496238564.swift@ipaidabribe.phpfogapp.com>', 'cctsodzo@gmail.com', NULL, 'Interest in Collaboration', 'Sender: Dr Charlton C. Tsodzo\r\nEmail: cctsodzo@gmail.com\r\nPhone: 00263712524936\r\n\r\nMessage: \r\nI''m very excited about your idea,and I believe this process if supported could be an important tool for fighting corruption in Zimbabwe. Where ar eyou guys based, I am a development researcher based in Zim, if there is scope for collaboration, joint publication, development of evidence-based advocacy etc I would be very keen on exploring possibilities.\r\nWill aait to hear from you\r\n\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~\r\nThis message was sent from your website at http://ipaidabribe.phpfogapp.com/\n\n', 1, '2012-06-02 21:39:31', 0, NULL, NULL),
(14, 0, 56, 0, 11, '<1338727270.23274.BPMail_high_carrier@web140404.mail.bf1.yahoo.com>', 'Clarkson Muza', NULL, 'Corruption by police Traffic sections.', 'Due to the nature of my job, i travel a lot. i have realised that chihuri sends the police at roadblocks to do the work in order to reduce road accidents. but instead, these officers go on the road to fill their pockets with bribe money. for example go to a roadblock at nguboyenja flyover along luveve road in bulawayo. the officers there collect bribe money in full view of members of the public. i have a lot of friends in the police. i talk to them about what happens at these roadblock. one told me that the juniors are given targets to raise bribe money daily by their bosses. he further told me that the bosses protects the juniors in case a report is made. recently an anti corruption team was launched by police provincial command. this team is just a toothless dog as it has not made significant arrests. i am reliable informed that this team was given strict instructions not to visit roadblocks manned by traffic section without prior notice. the reason is\r\n that once the traffic section command is notified of an impending visit, they advise their members to be cautious. if there are any authorities out there who wish to make some arrests, please do not advise the police commanders of the station concerned because they will advise their juniors. i am further informed that these officers are now getting even assistance from the local courts where cases are being dealt with in favour of the one who is ready to part with a substantial amount of money.\n\n', 1, '2012-06-03 14:41:12', 0, NULL, NULL),
(15, 0, 58, 0, 11, '<1338757509.61226.BPMail_high_carrier@web140406.mail.bf1.yahoo.com>', 'Clarkson Muza', NULL, 'Updates on action taken', 'I would like to congradulate the brains behind this whistle-blowing site. Under normal circumstances, this project was supposed to have been launched by the law enforcement agency if ever they had the will to eradicate corruption. The advent of this project will see more corrupt individuals being exposed. I would like to know as to what action do you take upon receipt of the information besides publishing on this site. It will be much interesting and encouraging if the action taken and results are also published on the site. Keep up the good work.\n\n', 1, '2012-06-03 23:05:10', 0, NULL, NULL),
(16, 0, 64, 0, 12, '<B8DD2E1E-B73C-4105-A415-878D148BC2A4@yoafrica.com>', 'Judy Willsher', NULL, 'Traffic cops', 'Attached report.\n\n', 1, '2012-06-06 05:56:19', 0, NULL, NULL),
