(19, 0, 65, 0, 14, '<1339013643.51155.YahooMailNeo@web28706.mail.ir2.yahoo.com>', 'Barbara Leith', NULL, 'Bulawayo  Home Affairs Office', 'Good Evening,\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; I saw your site advertized on Face Book by Peter Goodwin..,so thought I would write to you ans relate " my story "..\n\nI returned home to Bulawayo from South Africa in 1999,to work for a mining company,Gunquip,who specialized in " Mine Under Ground Support Systems "..\n\nWhilst applying for a " work permit " I dealt directly with the chief Immigration Officer,Mr Sydringham Madzudzo..who promised me that he could sort out a work permit in no time at all,and with out any hassels,as he knew the head of the Home Affairs Department in Harare..BUT !!!??? it would cost me R300.00.\n\nSo to avoid any hassels,and to secure a work permit,I handed over the money to him..\n\nRoughly 3 weeks later he contacted me in South Africa and told me my " Work Permit " was ready for collection from his office..,but I was required to collect it personally.\n\nI returned to Bulawayo a few days later..,and was told by Mr Madzudzo that as a gesture of Good Will,the Chief Immigration Officer in Harare had processed the permit quickly..,and wanted R250.00 for doing so.\n\nI was then given my Work Permit after handing over the money..\n\nWhen I renewed my work permit in 2002,I had to give Mr Madzudzo " A Cash Gift "..\n\nIn 2005 when my permit was up for renewal,I was also elegible to apply for Returning Residence Status,which I did..\n\nSadly,it was going to cost me 10,000 bricks and 100 bags of cement,which would be donated to the Seventh Day Adventist Church on the Johannesburg road,Mr Madzudzo was the assistant pastor at the Church I think..,the expense was too much..,so I had no option but to leave Zimbabwe...\n\nThat ismy story about having tp pay bribes...,Darryl Leith\n\n', 1, '2012-06-06 22:14:07', 0, NULL, NULL),
