(21, 0, 71, 0, 16, '<68133A2DFFEC41ECA07F515A3B9FF1DD@VanessaPC>', 'Vanessa & Digby Bristow', NULL, 'Incorrect ticketing for no front number plate - Beitbridge', 'Letter speaks for itself.   THRILLED to have this service!  Thank you!!!! Vanessa Bristow\r\n\r\n\r\n__________ Information from ESET NOD32 Antivirus, version of virus signature database 7205 (20120608) __________\r\n\r\nThe message was checked by ESET NOD32 Antivirus.\r\n\r\nhttp://www.eset.com\n\n', 1, '2012-06-08 12:10:38', 0, NULL, NULL),
(22, 0, 0, 0, 17, '<CACBz+sjT6EHSZxbnyZw3+-RE54Jh=m+SW+=C5C91S=Sg5MFdRA@mail.gmail.com>', 'Steve Eldon Kerr', NULL, 'IPaidaBribe', 'To whom it may concern:\r\n\r\nI''m an activist and journalist in the UK, and was wondering if you could\r\nprovide me with some more details on who is behind this website. I will, of\r\ncourse, respect confidentiality and change names where you desire. I am\r\ninterested in how many people are behind the site, the sources of funding,\r\nand in getting some comments from the people who run the site. If you could\r\nput me in touch with a contact from your sponsors that would be wonderful\r\nas well. Essentially I''m looking for the story behind the site. Please let\r\nme know if this is okay either way.\r\n\r\nThanks,\r\n\r\nSteve Eldon Kerr\r\nLondon\n\n', 1, '2012-06-11 13:18:57', 0, NULL, NULL),
(23, 0, 73, 0, 18, '<5b1be59d.a762.4991.9677.3b08926de22c@aol.com>', 'mck2886', NULL, 'Zimbabwe Customs', 'On June 13, 2012 my daughter (US passport) paid her and her sister''s entry visa with $60 ($30 each).  The Customs officer took the money then proceeded to act as if he was busy, then returned and asked for the money again.  When she complained that she had already paid, he became angry, kept her passport and sent her to the back of the line. She was then forced to pay again.  No receipt was given. Be aware to pay with the exact amount and insist on a receipt before the Customs Officer leaves or tries to conduct any other business.\n\n', 1, '2012-06-13 15:37:37', 0, NULL, NULL),
(24, 0, 0, 0, 19, '<500E96AA.6080309@gmail.com>', 'Tawanda Kembo', NULL, 'Police takes bribe and ignitions keys from Kombi driver', 'At around 11 am this morning, a BMW police car stopped the kombi I was \r\nin along Mt. Pleasant road. The driver got out and before he was charged \r\nwith anything he took $10 bill from his pocket and gave it to the police \r\nofficer. I did not hear what the police officer said but he went on \r\nswitch off the kombi and remove the ignition keys. We had to finish the \r\nrest of the journey on foot.\r\n\r\nAre police officers allowed to do this? Are all kombi drivers always \r\nguilty of breaking some law?\n\n', 1, '2012-07-24 12:36:03', 0, NULL, NULL),
(25, 0, 129, 0, 14, '<1348460213.64571.YahooMailClassic@web133101.mail.ir2.yahoo.com>', 'Barbara Leith', NULL, 'Hi', '&nbsp;I am in Madrid Spain at the moment, I am here for a conference and I \njust had my bag stolen from me with my passport and personal effects. I \nhave been trying to sort things out with the necessary authorities, I \nneed some assistance from you. \r\n\n&nbsp;\r\n\n&nbsp;Let me know if you can be of any help. &nbsp;\r\n\n\r\n\n\r\n\n&nbsp;Barbara\n\n', 1, '2012-09-24 06:16:57', 0, NULL, NULL),
