(27, 0, 0, 0, 21, '<cm.035627.jdllcl.wdlkrkljd.y@cmail1.com>', 'Team Ushahidi', NULL, 'Deployment of the Week - Your new Badge', 'Web Version http://ushahidicom.cmail1.com/t/y-e-jdllcl-wdlkrkljd-g/&nbsp;&nbsp;|&nbsp;  Update preferences http://ushahidicom.updatemyprofile.com/y-jdllcl-3E75CC33-wdlkrkljd-w&nbsp;&nbsp;|&nbsp;  Unsubscribe http://ushahidicom.cmail1.com/t/y-u-jdllcl-wdlkrkljd-yd/               http://ushahidicom.cmail1.com/t/y-fb-jdllcl-wdlkrkljd-yh/   Like http://ushahidicom.cmail1.com/t/y-fb-jdllcl-wdlkrkljd-yk/     http://ushahidicom.cmail1.com/t/y-tw-jdllcl-wdlkrkljd-yu/   Tweet http://ushahidicom.cmail1.com/t/y-tw-jdllcl-wdlkrkljd-jl/      Forward http://ushahidicom.forwardtomyfriend.com/y-wdlkrkljd-3E75CC33-jdllcl-l-jr\r\n\r\nTABLE OF CONTENTS\r\n\r\n&bull;\r\n\r\nThank you!\r\n\r\nWEB VIEW\r\n\r\nHaving trouble viewing this email?  View it in your browser. http://ushahidicom.cmail1.com/t/y-e-jdllcl-wdlkrkljd-jy/\r\n\r\nUNSUBSCRIBE\r\n\r\nWe''re sending this to you because you gave us your email address on our website. If you don''t want to receive email newsletters from us,  unsubscribe here. http://ushahidicom.cmail1.com/t/y-u-jdllcl-wdlkrkljd-jj/                You are a Deployment of the Week\r\n\r\nThank you!\r\n\r\nThe Ushahidi Deployment of the Week program is over a year old.\r\n\r\nThank you for deploying Ushahidi. Each of you and your teams have lead or tested deployments for crisis mapping, anti-corruption activism, election monitoring and a wide-range of civil society actions.\r\n\r\nSee all the Deployments of the Week for 2011 and 2012 (so far.) [https://wiki.ushahidi.com/display/WIKI/Deployments+of+the+Week]\r\n\r\nThere is an  Ushahidi Community Map [https://community.crowdmap.com] created to connect deployers and users. Feel free to add your deployment or yourselves.\r\n\r\nWe''ve created this badge which you can use for your deployment cited as Deployment of the Week. You can download it from the wiki.\r\n\r\n(If you need a different badge file, please drop us a note at support at ushahidi dot com.)\r\n\r\n\r\n\r\nYour new Deployment of the Week Badge!\r\n\r\nThanks again and Happy Mapping,\r\n\r\nThe Ushahidi Team\r\n\r\nSince 2008, Ushahidi has been changing the way information flows. Thanks for paying attention.  Contact us [http://ushahidi.com/contact-us].\r\n\r\nGet Involved  Volunteer Registration [http://ushahidi.com/contact-us/volunteer]  Join Our Community [http://community.ushahidi.com/]  Language Translations [https://wiki.ushahidi.com/display/WIKI/Localization+and+Translation]  Help Forum [http://forums.ushahidi.com/]  Our wiki [http://wiki.ushahidi.com]  Development Wiki [http://wiki.ushahidi.com/display/WIKI/Ushahidi+Developer+Guide]  Bug Tracker [https://github.com/ushahidi/Ushahidi_Web/issues]      About  Our Mission [http://www.ushahidi.com/about-us]  The Team [http://www.ushahidi.com/about-us/team]  History [http://www.ushahidi.com/about-us#history]\n\n', 1, '2012-11-23 18:56:31', 0, NULL, NULL),
(28, 0, 127, 0, 15, '276687622712197121', 'IPaidABribeZim', NULL, 'Zimbabwe most corrupt country in SADC region #IPABZim - #CPI2012 http://t.co/pxqtTxqt', NULL, 1, '2012-12-06 16:00:44', 0, NULL, NULL),
(29, 0, 128, 0, 21, '<CAHh=9DjQV_KpBGDuM=o+KwCTHvi8DUtqYeNhouY3_1kuU49u2g@mail.gmail.com>', 'Heather Leson', NULL, 'Re: Congratulations Deployment of the Week! - I Paid of the Bribe', 'HI Folks, we have heard some things about actions against folks in civil\r\nsociety in Zimbabwe. Please be safe.\r\n\r\nHere are some guidelines that we created that might be helpful for you\r\n\r\nhttps://wiki.ushahidi.com/display/WIKI/Security+Resources\r\n\r\nAll the best,\r\n\r\nheather\r\n\r\nOn Fri, Oct 26, 2012 at 7:35 AM, Heather Leson &lt;hleson@ushahidi.com&gt; wrote:\r\n\r\n&gt; Congratulations! You are the Deployment of the Week! Please find your\r\n&gt; attached Deployment of the Week badge which you are feel to you in\r\n&gt; promotion.\r\n&gt;\r\n&gt; Thank you for all the hard work you are doing with:\r\n&gt; http://www.ipaidabribe.org.zw\r\n&gt;\r\n&gt; Some publications about this announcement:\r\n&gt; https://wiki.ushahidi.com/display/WIKI/Deployments+of+the+Week\r\n&gt;\r\n&gt; http://blog.ushahidi.com/index.php/2012/10/25/weekly-community-leaders-ideo-hackathon/\r\n&gt;\r\n&gt;\r\n&gt; Also, I wanted to let you that I will feature your work at the\r\n&gt; International Anti-Corruption Conference in Brazil next week:\r\n&gt; http://15iacc.org/\r\n&gt;\r\n&gt; If you ever need anything from us, please let us know!\r\n&gt;\r\n&gt; Heather\r\n&gt;\r\n&gt; --\r\n&gt; Heather Leson\r\n&gt; Director of Community Engagement\r\n&gt; *Ushahidi*\r\n&gt; hleson@ushahidi.com\r\n&gt; www.ushahidi.com\r\n&gt; @heatherleson\r\n&gt;\r\n&gt;\r\n\r\n\r\n-- \r\nHeather Leson\r\nDirector of Community Engagement\r\n*Ushahidi*\r\nhleson@ushahidi.com\r\nwww.ushahidi.com\r\n@heatherleson\n\n', 1, '2013-02-21 16:05:54', 0, NULL, NULL),
