(33, 0, 0, 0, 21, '<cm.084212.trttak.ykllhtdrij.y@cmail2.com>', 'Ushahidi', NULL, 'Ushahidi - Upgrade Days are here again', 'HI There!\r\n\r\n\r\nAre you on the latest Ushahidi Version?\r\n\r\nUpgrade Days are on the May 30 &ndash; 31, 2013 [http://blog.ushahidi.com/2013/05/20/upgrade-day-2-7-may-2013/]. Together the team and community will to help you make the change from running older versions of the Ushahidi platform to upgrade to the latest and most secure version of Ushahidi.\r\n\r\nHELP or be a HELPER\r\n\r\nWe''ve set up a schedule to help match deployers in need and developers. Some deployers have become pros and others need pros. Together we can help us get each other on the latest version.\r\n\r\nWhether you NEED HELP or CAN HELP,  simply add your name, deployment name, available times along with either your ask or offer. [https://docs.google.com/a/ushahidi.com/spreadsheet/ccc?key=0AisCbUDEZly6dFNIdzVJQzdQQms2RGFPOUZuS1NDcGc#gid=0]  Upgrade Day is for two days across multiple timezones between May 30 - 31, 2013.\r\n\r\nWhy upgrade and How To!\r\n\r\nHere are some of the top reasons to upgrade:\r\n\r\nsecurity patches [https://wiki.ushahidi.com/display/WIKI/1+May+2013+-+CVE-2013-2025]  big bug fixes to custom forms and upload/download reports   Changes to Twitter''s API [https://wiki.ushahidi.com/display/WIKI/Configuring+Twitter+on+a+deployment]  All the glory of being on the latest code set : )\r\n\r\nWe''ve written up  some help docs on the wiki  [https://wiki.ushahidi.com/display/WIKI/Migrating+to+a+newer+Ushahidi+version]to guide you through the upgrade process.\r\n\r\nJoin us either in person or simply upgrade to the latest Ushahidi - 2.7.\r\n\r\nRemember, you can always  CONTACT US [https://wiki.ushahidi.com/display/WIKI/Contact+Us] too!\r\n\r\nThanks!\r\n\r\nThe Ushahidi Team\r\n\r\nJoin Our Community [http://community.ushahidi.com/]  \r\nLanguage Translations [https://wiki.ushahidi.com/display/WIKI/Localization+and+Translation]  Help Forum [http://forums.ushahidi.com/]  Our wiki [http://wiki.ushahidi.com]  \r\nBug Tracker [https://github.com/ushahidi/Ushahidi_Web/issues]  \r\n\r\nThis email was sent to mystory@ipaidabribe.org.zw.\r\nIf you are no longer interested you can unsubscribe instantly:\r\nhttp://ushahidicom.cmail2.com/t/y-u-trttak-ykllhtdrij-g/\n\n', 1, '2013-05-24 00:42:17', 0, NULL, NULL);
