INSERT INTO `page` (`id`, `page_title`, `page_description`, `page_tab`, `page_active`) VALUES
(1, 'About Us', '<p style="margin-top: 0.6em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; background-color: rgb(255, 255, 255); "><p style="margin:0in;font-family:Calibri;font-size:17.0pt">What</p></p><p style="margin-top: 0.6em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; background-color: rgb(255, 255, 255); "><a href="http://www.ipaidabribe.org.zw">ipaidabribe.org.zw</a> is an initiative to tackle corruption by\nharnessing the collective energy of citizens to show how much corruption is\ngoing on around. It aims to quantify petty corruption by\nunderstanding the role of\nbribery in public service delivery. The uniqueness of this anti-corruption\nmovement lies in transforming data into knowledge to inform the government\nabout gaps in public transactions and in strengthening citizen engagement\nto improve the quality of service delivery<span style="color: rgb(73, 73, 73); font-size: 9pt; font-family: Helvetica; ">. </span><br></p><p style="margin-top: 0.6em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; background-color: rgb(255, 255, 255); "><p style="margin:0in;font-size:9.0pt;color:#494949"><span style="font-family:Helvetica"><br></span></p><p style="margin: 0in; "><p style="margin:0in;font-family:Calibri;font-size:17.0pt">How</p></p><p style="margin: 0in; "><p style="margin: 0in; ">You\ncan report on the nature, number, pattern, types, location, frequency and\nvalues of actual corrupt acts, not just on this website, but also via email and\nSMS. Your reports will, perhaps for the first time, provide a snapshot of\nbribes occurring across your area. We will use them to argue for improving\ngovernance systems and procedures, tightening law enforcement and regulation\nand thereby reduce the scope for corruption in obtaining services from the\ngovernment</p><p style="color: rgb(73, 73, 73); margin: 0in; font-family: Helvetica; font-size: 9pt; "><br></p><p style="margin: 0in; "><p style="color: rgb(73, 73, 73); margin: 0in; font-family: Calibri; font-size: 17pt; ">Why</p><p style="margin: 0in; "><p style="margin: 0in; ">While some people\nregard bribery as a fact of life, the absolute majority would rather do without\nit. Unfortunately, it is hard to fight corruption when you are alone.\nipaidabribe changes the equation by giving you a chance to report anonymously\nbribes.</p></p></p></p><p style="margin:0in;font-size:9.0pt;color:#494949"><span style="font-family:Helvetica"><br></span></p></p><p></p>', 'About Us', 1),
(2, 'How it works', '<p style="margin: 0in; ">You\ncan report on the nature, number, pattern, types, location, frequency and\nvalues of actual corrupt acts, not just on this <a href="http://www.ipaidabribe.org.zw">website</a>, but also via <a href="mailto:mystory@ipaidabribe.org.zw">email </a>and\nSMS. Your reports will, perhaps for the first time, provide a snapshot of\nbribes occurring across your area. We will use them to argue for improving\ngovernance systems and procedures, tightening law enforcement and regulation\nand thereby reduce the scope for corruption in obtaining services from the\ngovernment</p>', 'How it works', 1),
(3, 'Sponsors (In no particular order)', '<h3>We would like to thank the following sponsors for thier support:</h3><div><a href="http://www.zimeye.org"> <img src="http://www.ipaidabribe.org.zw/media/img/sponsors/zimeye.jpg">  </a>        </div><div><a href="http://www.mega24.co.za"><br></a></div><div><a href="http://www.mega24.co.za"><img src="http://www.ipaidabribe.org.zw/media/img/sponsors/mega24.jpg"></a><br></div><div><br></div> <a href="http://www.eatout.co.zw"><img src="http://www.ipaidabribe.org.zw/media/img/sponsors/eatout.jpg"> </a><div><br><div><br></div><div>Any parties interested in becoming partner and/or sponsors are invited to contact: <a href="mailto:sponsors@ipaidabribe.org.zw">sponsors@ipaidabribe.org.zw</a></div></div>', 'Sponsors', 1),
(4, 'Thank You', '<h2 style="text-align: center;">Thank you for making a donation. </h2><div style="text-align: center;"><br></div><h1 style="text-align: center;">You''re the greatest!</h1>', 'Thank You', 0);
